(11, '\"Үсчин, Гоо сайхан, хумс дизайн урлалын тэмцээн-2023\" ур чадварын тэмцээнд амжилттай оролцсон багш, суралцагч нартаа баяр хүргэе', '20231117220029', '2023-11-17 22:02:09', '<p>\"Үсчин, Гоо сайхан, хумс дизайн урлалын тэмцээн-2023\" ур чадварын тэмцээнд амжилттай оролцсон багш, суралцагч нартаа баяр хүргэе<img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/tfe/1/16/1f44f.png\" alt=\"👏\" height=\"16\" width=\"16\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/tfe/1/16/1f44f.png\" alt=\"👏\" height=\"16\" width=\"16\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/tfe/1/16/1f44f.png\" alt=\"👏\" height=\"16\" width=\"16\"></p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t9f/1/16/1f1f2_1f1f3.png\" alt=\"🇲🇳\" height=\"16\" width=\"16\">Өвөрхангай аймгийн аварга шалгаруулах \"Үсчин, Гоо сайхан, хумс дизайн урлалын тэмцээн-2023\"  ур чадварын тэмцээнд <a href=\"https://www.facebook.com/uvcollege?__cft__[0]=AZXD1KGeld-Gwulo7AB8glhbe4zDKsAfS-Po0gJTZZ4EGbC8YenBfyG5bTJ9_msfodDwILQYJ6Y4rqUH2aC9jpm8LI44vHv6pVhKDWTKG5WKIb22I-m9dMaSZHT6syX4pWdizuB1VaeM8fVv_IxlGT2YFKolItErdeRaH6t-pOlWU_oICFKXasv0z7EKUHXTqyQ&amp;__tn__=-]K-R\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"background-color: transparent; color: var(--accent);\">Өвөрхангай аймаг дахь Политехник Коллеж</a>ийн Үсчин мэргэжлийн багш <a href=\"https://www.facebook.com/hashtag/%D0%B1_%D0%BE%D1%8E%D1%83%D0%BD%D0%B4%D0%B0%D1%80%D1%8C?__eep__=6&amp;__cft__[0]=AZXD1KGeld-Gwulo7AB8glhbe4zDKsAfS-Po0gJTZZ4EGbC8YenBfyG5bTJ9_msfodDwILQYJ6Y4rqUH2aC9jpm8LI44vHv6pVhKDWTKG5WKIb22I-m9dMaSZHT6syX4pWdizuB1VaeM8fVv_IxlGT2YFKolItErdeRaH6t-pOlWU_oICFKXasv0z7EKUHXTqyQ&amp;__tn__=*NK-R\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"background-color: transparent; color: var(--accent);\">#Б_Оюундарь</a> \"Эмэгтэй үс хэлбэржүүлэлт\" төрөлд <a href=\"https://www.facebook.com/hashtag/%D0%B3%D1%83%D1%82%D0%B3%D0%B0%D0%B0%D1%80?__eep__=6&amp;__cft__[0]=AZXD1KGeld-Gwulo7AB8glhbe4zD