DWTKG5WKIb22I-m9dMaSZHT6syX4pWdizuB1VaeM8fVv_IxlGT2YFKolItErdeRaH6t-pOlWU_oICFKXasv0z7EKUHXTqyQ&amp;__tn__=*NK-R\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"background-color: transparent; color: var(--accent);\">#ШИЛДЭГ_ГРАНПРИ</a> цом, </p><p>Гоо засалч мэргэжлийн ангийн суралцагч <a href=\"https://www.facebook.com/hashtag/%D0%B4_%D0%BD%D1%8D%D1%80%D0%B3%D2%AF%D0%B9?__eep__=6&amp;__cft__[0]=AZXD1KGeld-Gwulo7AB8glhbe4zDKsAfS-Po0gJTZZ4EGbC8YenBfyG5bTJ9_msfodDwILQYJ6Y4rqUH2aC9jpm8LI44vHv6pVhKDWTKG5WKIb22I-m9dMaSZHT6syX4pWdizuB1VaeM8fVv_IxlGT2YFKolItErdeRaH6t-pOlWU_oICFKXasv0z7EKUHXTqyQ&amp;__tn__=*NK-R\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"background-color: transparent; color: var(--accent);\">#Д_Нэргүй</a> \"Сормуус урлал\"-ын төрөлд <a href=\"https://www.facebook.com/hashtag/%D0%B3%D1%83%D1%82%D0%B3%D0%B0%D0%B0%D1%80?__eep__=6&amp;__cft__[0]=AZXD1KGeld-Gwulo7AB8glhbe4zDKsAfS-Po0gJTZZ4EGbC8YenBfyG5bTJ9_msfodDwILQYJ6Y4rqUH2aC9jpm8LI44vHv6pVhKDWTKG5WKIb22I-m9dMaSZHT6syX4pWdizuB1VaeM8fVv_IxlGT2YFKolItErdeRaH6t-pOlWU_oICFKXasv0z7EKUHXTqyQ&amp;__tn__=*NK-R\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"background-color: transparent; color: var(--accent);\">#ГУТГААР</a> байр тус тус эзэлж амжилт дүүрэн оролцлоо.  </p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t19/1/16/1f49f.png\" alt=\"💟\" height=\"16\" width=\"16\">Чадварлаг багш, суралцагч нартаа халуун баяр хүргэж цаашдын ажил, хөдөлмөрт нь арвин их амжилтыг хүсэн ерөөе.</p>', 1, 1),
(12, 'ТӨГСӨГЧДИЙН ВОЛЕЙБОЛЫН ТЭМЦЭЭН АМЖИЛТТАЙ ЗОХИОН БАЙГУУЛАГДАВ', '20231122214813', '2023-11-11 21:49:21', '<p><span style=\"color: rgb(102, 102, 102);\">Боловсрол, шинжлэх ухааны яамны харьяа, магадлан итгэмжлэгдсэн Өвөрхангай аймаг дахь Политехник коллежийн түүхт 50 жилийн ойг угтаж зохион байгуулсан төгсөгчдийн волейболын тэмцээн амжилттай зохион байгуулагдав.</span></p><p><span style=\"color: rgb(102, 102, 102);\">✍️Тэмцээнд 35 багийн 300 гаруй тамирчид оролцож, хурд хүч, авхаалж самбаагаа сорьж 2 өдрийг нөхөрсөг, гал гарсан тоглолтуудаар үргэлжилж аваргуудаа шалгарууллаа.</span></p><p><span style=\"color: rgb(102, 102, 102);\">📍2004-2015 оны төгсөгчдийн эрэгтэй төрөлд:</span></p><p><span style=\"color: rgb(102, 102, 102);\">🥇ТЭРГҮҮН байрт А.Далайцэрэн ахлагчтай “Компьютер 2-1” 2014 оны төгсөлтийн баг тамирчид</span></p><p><span style=\"color: rgb(102, 102, 102);\">🥈ДЭД байр Б.Зүмбэ ахлагчтай “Star” 2012 оны төгсөлтийн баг тамирчид</span></p><p><span style=\"color: rgb(102, 102, 102);\">🥉ГУТГААР байр А.Галмандах ахлагчтай “Инженер механик” 2014 оны төгсөлтийн баг тамирчид</span></p><p><span style=\"color: rgb(102, 102, 102);\">🏐ШИЛДЭГ ТОГЛОГЧООР “Компьютер 2-1” багийн 2014 оны төгсөгч А.Далайцэрэн</span></p><p><span style=\"color: rgb(102, 102, 102);\">📍Эмэгтэй төрөлд:</span></p><p><span style=\"color: rgb(102, 102, 102);\">🥇ТЭРГҮҮН байр Н.Даваасүрэн ахлагчтай “Өөдрөг” 2015 оны төгсөлтийн баг тамирчид</span></p><p><span style=\"color: rgb(102, 102, 102);\">🥈ДЭД байр Ч.Батнасан ахлагчтай “Компьютер 2-1” 2011 оны төгсөлтийн баг тамирчид</span></p><p><span style=\"color: rgb(102, 102, 102);\">🥉ГУТГААР байр Б.Эрдэнэтуяа ахлагчтай “Санхүүчид” 2004 оны төгсөлтийн баг тамирчид</span></p><p><span style=\"color: rgb(102, 102, 102);\">🏐ШИЛДЭГ ТОГЛОГЧООР “Санхүүчид” багийн 2004 оны төгсөгч Б.Эрдэнэтуяа</span></p><p><span style=\"color: rgb(102, 102, 102);\">2016-2023 төгсөгчдийн эрэгтэй төрөлд:</span></p><p><span style=\"color: rgb(102, 102, 102);\">🥇ТЭРГҮҮН байр С.Намбарнанзад ахлагчтай “Идэрчүүд” 2023 оны төгсөлтийн баг тамирчид</span></p><p><span style=\"color: rgb(102, 102, 102);\">🥈ДЭД байр П.Самдан ахлагчтай “Pheonex” 2022 оны төгсөлтийн баг тамирчид</span></p><p><span style=\"color: rgb(102, 102, 102);\">🥉ГУТГААР байр Б.Аварзэд ахлагчтай “Залгамж” 2016 оны төгсөлтийн баг тамирчид</span></p><p><span style=\"color: rgb(102, 102, 102);\">🏐ШИЛДЭГ ТОГЛОГЧООР “Идэрчүүд” багийн 2023 оны төгсөгч Э.Шинэхүү</span></p><p><span style=\"color: rgb(102, 102, 102);\">Эмэгтэй төрөлд:</span></p><p><span style=\"color: rgb(102, 102, 102);\">🥇ТЭРГҮҮН байр Ж.Нанжидмаа ахлагчтай “Champions” 2023 оны төгсөлтийн баг тамирчид</span></p><p><span style=\"color: rgb(102, 102, 102);\">🥈ДЭД байр P.Энхжин ахлагчтай “Volleyball team” 2023 оны төгсөлтийн баг тамирчид</span></p><p><span style=\"color: rgb(102, 102, 102);\">🥉ГУТГААР байр А.Ариунхишиг ахлагчтай “Тэмүүлэл” 2021 оны төгсөлтийн баг тамирчид</span></p><p><span style=\"color: rgb(102, 102, 102);\">🏐ШИЛДЭГ ТОГЛОГЧООР “Champions” багийн 2023 оны төгсөгч Ж.Нанжидмаа нар тус тус шалгарлаа.</span></p><p><span style=\"color: rgb(102, 102, 102);\">Нийт оролцсон баг тамирчдадаа талархал илэрхийлж цаашдын ажил, хөдөлмөрт нь амжилт хүсье.</span></p><p><span style=\"color: rgb(102, 102, 102);\">🤩Тэмцээнийг амжилттай зохион байгуулсан Өвөрхангай аймаг дахь Политехник Коллежийн Ц.Батжаргал ахлагчтай Биеийн тамир, спортын хамтлагийнхандаа болон нийт багш, ажилчдадаа талархал илэрхийлье.</span></p>', 1, 1),
(13, 'ЕРӨНХИЙ ЭРДМИЙН БАГШ НАР МЭРГЭД СУРГУУЛИЙН ХИЧЭЭЛ СУРГАЛТЫН ҮЙЛ АЖИЛЛАГААТАЙ ТАНИЛЦЛАА.', '20231122215130', '2023-11-07 21:51:58', '<p>Сургууль хоорондын хамтын ажиллагааг хөгжүүлж, багшийн сайн туршлага, арга зүйг судлах зорилгоор Өвөрхангай аймаг дахь Политехник Коллежийн ерөнхий эрдмийн багш нар Ерөнхий боловсролын лаборатори Мэргэд сургууль багш нартай арга зүй, туршлагаа солилцлоо.&nbsp;&nbsp;</p><p><span style=\"color: rgb(0, 0, 0);\">Биднийг халуун дотноор угтан авч хичээл сургалтын үйл ажиллагаатайгаа танилцуулсан Н.Норгинханд захиралтай Мэргэд сургуулийн хамт олондоо цаашдын ажил, хөдөлмөрт нь өндөр амжилтыг хүсэн ерөөе</span></p>', 1, 1),
(14, 'ӨВӨРХАНГАЙ АЙМГИЙН ТОГООЧ НАРЫН СПОРТ, УРЛАГИЙН БАГА НААДАМ АМЖИЛТТАЙ ЗОХИОН БАЙГУУЛАГДЛАА', '20231122215640', '2023-11-06 21:57:18', '<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t24/1/16/1f9d1_200d_1f373.png\" alt=\"🧑‍🍳\" height=\"16\" width=\"16\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t74/1/16/1f468_200d_1f373.png\" alt=\"👨‍🍳\" height=\"16\" width=\"16\">ӨВӨРХАНГАЙ АЙМГИЙН ТОГООЧ НАРЫН СПОРТ, УРЛАГИЙН БАГА НААДАМ АМЖИЛТТАЙ ЗОХИОН БАЙГУУЛАГДЛАА. </p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/te2/1/16/270d.png\" alt=\"✍️\" height=\"16\" width=\"16\">Өвөрхангай аймгийн Боловсрол, шинжлэх ухааны газар, Өвөрхангай аймаг дахь Политехник Коллеж, аймгийн Эрүүл мэндийн газар, Өвөрхангай аймгийн тогооч нарын холбоо хамтран зохион байгуулсан <a href=\"https://www.facebook.com/hashtag/%D1%82%D0%BE%D0%B3%D0%BE%D0%BE%D1%87_%D0%BD%D0%B0%D1%80%D1%8B%D0%BD_%D1%83%D1%80%D0%BB%D0%B0%D0%B3_%D1%81%D0%BF%D0%BE%D1%80%D1%82%D1%8B%D0%BD_%D0%B1%D0%B0%D0%B3%D0%B0_%D0%BD%D0%B0%D0%B0%D0%B4%D0%B0%D0%BC?__eep__=6&amp;__cft__[0]=AZV7_uLeRUYFXFkev_iSTScI2cc7v8RkZ4IPQk2lyuOABWKVLXUEYbpoB49qXuZ23pE4SXe8Byg7MChMwz93xJ1axAblECgu8Ad21HcsJltYUSo9noWml9zlKcnEA0yiXMEs1ierRsKOQJVTyMMWyobGbZBeXsF4DYITk88lhLwp9CYBAbkzl79XV_6qpUgtV-M&amp;__tn__=*NK-R\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"background-color: transparent; color: var(--accent);\">#Тогооч_нарын_урлаг_спортын_бага_наадам</a> амжилттай зохион байгуулагдаж шилдэгүүдээ шалгарууллаа. </p><p>Багийн нэгдсэн дүнгээр:</p><p><a href=\"https://www.facebook.com/hashtag/%D1%82%D1%8D%D1%80%D0%B3%D2%AF%D2%AF%D0%BD?__eep__=6&amp;__cft__[0]=AZV7_uLeRUYFXFkev_iSTScI2cc7v8RkZ4IPQk2lyuOABWKVLXUEYbpoB49qXuZ23pE4SXe8Byg7MChMwz93xJ1axAblECgu8Ad21HcsJltYUSo9noWml9zlKcnEA0yiXMEs1ierRsKOQJVTyMMWyobGbZBeXsF4DYITk88lhLwp9CYBAbkzl79XV_6qpUgtV-M&amp;__tn__=*NK-R\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"background-color: transparent; color: var(--accent);\">#ТЭРГҮҮН</a> байр</p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t94/1/16/1f947.png\" alt=\"🥇\" height=\"16\" width=\"16\">Нарийнтээл, Баянтээг сумын тогооч нарын баг</p><p><a href=\"https://www.facebook.com/hashtag/%D0%B4%D1%8D%D0%B4?__eep__=6&amp;__cft__[0]=AZV7_uLeRUYFXFkev_iSTScI2cc7v8RkZ4IPQk2lyuOABWKVLXUEYbpoB49qXuZ23pE4SXe8Byg7MChMwz93xJ1axAblECgu8Ad21HcsJltYUSo9noWml9zlKcnEA0yiXMEs1ierRsKOQJVTyMMWyobGbZBeXsF4DYITk88lhLwp9CYBAbkzl79XV_6qpUgtV-M&amp;__tn__=*NK-R\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"background-color: transparent; color: var(--accent);\">#ДЭД</a> байр </p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t15/1/16/1f948.png\" alt=\"🥈\" height=\"16\" width=\"16\">Хархорин сумын тогооч нарын баг</p><p><a href=\"https://www.facebook.com/hashtag/%D0%B3%D1%83%D1%82%D0%B3%D0%B0%D0%B0%D1%80?__eep__=6&amp;__cft__[0]=AZV7_uLeRUYFXFkev_iSTScI2cc7v8RkZ4IPQk2lyuOABWKVLXUEYbpoB49qXuZ23pE4SXe8Byg7MChMwz93xJ1axAblECgu8Ad21HcsJltYUSo9noWml9zlKcnEA0yiXMEs1ierRsKOQJVTyMMWyobGbZBeXsF4DYITk88lhLwp9CYBAbkzl79XV_6qpUgtV-M&amp;__tn__=*NK-R\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"background-color: transparent; color: var(--accent);\">#ГУТГААР</a> байр </p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t96/1/16/1f949.png\" alt=\"🥉\" height=\"16\" width=\"16\">Арвайхээр сумын ЕБ-ын 5-р сургууль, 10,11,12 цэцэрлэгийн тогооч нарын баг тус тус шалгарлаа. </p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t50/1/16/1f525.png\" alt=\"🔥\" height=\"16\" width=\"16\">Зорин ирж бага наадамд оролцсон чадварлаг тогооч нартаа болон зохион байгуулсан Өвөрхангай аймгийн тогооч нарын холбоонд талархал илэрхийлье.</p>', 1, 1),
(15, '\"Харилцан хүндэлье\" эцэг эх, асран хамгаалагчдын сарын аян үргэлжил байна.', '20231122215904', '2023-11-03 21:59:29', '<p>\"Харилцан хүндэлье\" эцэг эх, асран хамгаалагчдын сарын аян үргэлжил байна. </p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t68/1/16/1f495.png\" alt=\"💕\" height=\"16\" width=\"16\">Эцэг эх <img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t68/1/16/1f495.png\" alt=\"💕\" height=\"16\" width=\"16\">суралцагч<img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t68/1/16/1f495.png\" alt=\"💕\" height=\"16\" width=\"16\">багш гурвын хамтын оролцоо сайн байснаар хүүхэд хөгжиж хүмүүжиж төлөвшдөг.<img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t49/1/16/1f4da.png\" alt=\"📚\" height=\"16\" width=\"16\"></p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/tea/1/16/1f970.png\" alt=\"🥰\" height=\"16\" width=\"16\">Хүүхдүүдээ сонсож, нээлттэй харилцаж, мэдрэмжийг нь хуваалцаж, хүүхдүүдтэйгээ нандин дурсамж бүтээх  <a href=\"https://www.facebook.com/hashtag/%D1%8D%D0%B5%D1%80%D1%8D%D0%B3_%D0%B1%D2%AF%D1%85%D0%BD%D0%B8%D0%B9%D0%B3_%D1%82%D2%AF%D0%B3%D1%8D%D1%8D%D0%B5?__eep__=6&amp;__cft__[0]=AZWQNaP9Z7GUXE08jDyCBBTxMfrcnW8EoenUyhnLIWHWOUlIPCfaxfTSmgnTl4f4ssAOxQ7vAfFK-_8wcMn7bFDDNAw2qmSeK10ZB3HY4o131rXFmdY5WNkzs5n0DsAByEL7dhPQ4HOY96llOc600NqFhnq2D61MuAnQjGNMZAYlrsmFSNbHBWi6T9Qsmk10BgU&amp;__tn__=*NK-R\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"background-color: transparent; color: var(--accent);\">#Эерэг_бүхнийг_түгээе</a> хайрын холбоог бэхжүүлэх уулзалт зохион байгуулагдав.</p><p>Арга хэмжээгээр:</p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/teb/1/16/2763.png\" alt=\"❣️\" height=\"16\" width=\"16\">Үр хүүхдээ ХАЙРЛАЖ, хайрладаг гэдгээ тэдэнд мэдрүүлэх</p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/teb/1/16/2763.png\" alt=\"❣️\" height=\"16\" width=\"16\">Хүүхдүүд хайрыг ХАМТДАА БАЙХ цаг гэдэг утгаар хүлээн авдаг тул тэндээ цаг гаргаж байх</p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/teb/1/16/2763.png\" alt=\"❣️\" height=\"16\" width=\"16\">Гэр бүлээрээ зугаатай цаг өнгөрүүлэх нь САЙХАН ДУРСАМЖ үлдээдэг</p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/teb/1/16/2763.png\" alt=\"❣️\" height=\"16\" width=\"16\">Бэлэг аваад ТАЛАРХАЖ сургах нь</p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/teb/1/16/2763.png\" alt=\"❣️\" height=\"16\" width=\"16\">ХАЙР, ТУУШТАЙ, САХИЛГАЖУУЛАЛТаар хүүхдүүдээ үлгэр дуурайллыг үзүүллээ.</p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t58/1/16/1f929.png\" alt=\"🤩\" height=\"16\" width=\"16\">Бидний урилгыг  хүлээн авч хүрэлцэн ирсэн та бүхэндээ талархал илэрхийлье.</p><p>Хүүхэд бүрийн гэгээлэг ирээдүйн төлөө</p><p>Хамтдаа сайн сайхныг бүтээцгээе.</p>', 1, 1),
(16, 'АМЖИЛТЫН БУУХИА', '20231122220052', '2023-11-02 22:01:15', '<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t62/1/16/1f4b8.png\" alt=\"💸\" height=\"16\" width=\"16\">”Дэлхийн хуримтлалын өдөр-2023” аяны хүрээнд Арвайхээр сумын ЕБС-иуд болон Политехник коллежийн суралцагчдын дунд зохион байгуулсан “САНХҮҮГИЙН БОЛОВСРОЛ МИНИЙ АМЬДРАЛД\" сэдэвт  <a href=\"https://www.facebook.com/hashtag/%D0%B4%D1%8D%D0%B2%D0%B6%D1%8D%D1%8D?__eep__=6&amp;__cft__[0]=AZXMRgrZWumYC8YplzS-t8Fu9yxG378ZzAfk-FU55PZBjGZgVFw0rHVEHnTG9fgen97yzzYu9giouBS5tEemT2Vp7f3gjJ7ieZCzjiwkvkEiGFxK-3jrb__PmMkiP11hCO_Mg4SdTf0WFEiPW2f-vKnRTYcFdkvi3L9EWbn2MJ3VLXcsUneNAtk_WAzEk72Vyd0&amp;__tn__=*NK-R\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"background-color: transparent; color: var(--accent);\">#Дэвжээ</a> тэмцээнд <a href=\"https://www.facebook.com/uvcollege?__cft__[0]=AZXMRgrZWumYC8YplzS-t8Fu9yxG378ZzAfk-FU55PZBjGZgVFw0rHVEHnTG9fgen97yzzYu9giouBS5tEemT2Vp7f3gjJ7ieZCzjiwkvkEiGFxK-3jrb__PmMkiP11hCO_Mg4SdTf0WFEiPW2f-vKnRTYcFdkvi3L9EWbn2MJ3VLXcsUneNAtk_WAzEk72Vyd0&amp;__tn__=-]K-R\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"background-color: transparent; color: var(--accent);\">Өвөрхангай аймаг дахь Политехник Коллеж</a>ийн   “Их ингүүмэл\" баг амжилттай оролцож <a href=\"https://www.facebook.com/hashtag/%D0%B4%D1%8D%D0%B4?__eep__=6&amp;__cft__[0]=AZXMRgrZWumYC8YplzS-t8Fu9yxG378ZzAfk-FU55PZBjGZgVFw0rHVEHnTG9fgen97yzzYu9giouBS5tEemT2Vp7f3gjJ7ieZCzjiwkvkEiGFxK-3jrb__PmMkiP11hCO_Mg4SdTf0WFEiPW2f-vKnRTYcFdkvi3L9EWbn2MJ3VLXcsUneNAtk_WAzEk72Vyd0&amp;__tn__=*NK-R\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"background-color: transparent; color: var(--accent);\">#ДЭД</a> байрд шалгарлаа.</p><p> <img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t51/1/16/1f449.png\" alt=\"👉\" height=\"16\" width=\"16\">Өсвөр үе, хүүхэд залуусын гэгээлэг ирээдүйн төлөө тэгш оролцоо, хөгжлийг дэмжсэн, санхүүгийн боловсрол, хувийн санхүүгээ зөв зохистой удирдахыг үе тэнгийнхэндээ эерэг манлайллаар сурталчилсан нөлөөллийн ажиллагааг зохион байгуулсан:</p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t51/1/16/1f449.png\" alt=\"👉\" height=\"16\" width=\"16\">Өвөрхангай аймгийн Гэр Бүл Хүүхэд Залуучуудын Хөгжлийн Газар</p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t51/1/16/1f449.png\" alt=\"👉\" height=\"16\" width=\"16\">Өвөрхангай аймгийн Насан Туршийн Боловсролын Төв</p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t51/1/16/1f449.png\" alt=\"👉\" height=\"16\" width=\"16\">Санхүү Төрийн Сангийн Хэлтэс</p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t51/1/16/1f449.png\" alt=\"👉\" height=\"16\" width=\"16\"> Өвөрхангай аймаг дахь Монгол банкны салбартаа талархал илэрхийлье.</p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t58/1/16/1f929.png\" alt=\"🤩\" height=\"16\" width=\"16\">Амжилттай оролцсон суралцагчдадаа болон чиглүүлэн ажилласан Нийгмийн ажилтан  Ж.Мягмаржав багшдаа баяр хүргэе<img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t7e/1/16/1f646_200d_2640.png\" alt=\"🙆‍♀️\" height=\"16\" width=\"16\"></p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/tb7/1/16/1f58b.png\" alt=\"🖋\" height=\"16\" width=\"16\"><a href=\"https://www.facebook.com/hashtag/%D1%85%D1%83%D1%80%D0%B8%D0%BC%D1%82%D0%BB%D0%B0%D0%BB%D1%8B%D0%B3?__eep__=6&amp;__cft__[0]=AZXMRgrZWumYC8YplzS-t8Fu9yxG378ZzAfk-FU55PZBjGZgVFw0rHVEHnTG9fgen97yzzYu9giouBS5tEemT2Vp7f3gjJ7ieZCzjiwkvkEiGFxK-3jrb__PmMkiP11hCO_Mg4SdTf0WFEiPW2f-vKnRTYcFdkvi3L9EWbn2MJ3VLXcsUneNAtk_WAzEk72Vyd0&amp;__tn__=*NK-R\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"background-color: transparent; color: var(--accent);\">#Хуримтлалыг</a> бий болгож Насан_туршдаа_суралцацгаая<img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t1f/1/16/1f4d7.png\" alt=\"📗\" height=\"16\" width=\"16\"></p>', 1, 1),
(17, 'БАЯРТ МЭДЭЭ', '20231123171312', '2023-11-23 17:14:15', '<p>Улсын аварга шалгаруулах үсчин, гоо засалч, хумс урлалын хоёрдугаар тэмцээнд Өвөрхангай аймаг дахь Политехник Коллежийн Гоо засалч мэргэжлийн багш Ш.Энхзаяа амжилттай оролцож мэргэжлийн зураглалтай хумс будалтын төрөлд ГУТГААР байранд шалгарлаа.</p><p>🔥Чадварлаг багшдаа халуун баяр хүргэж цаашдын ажил хөдөлмөрт нь улам их амжилтыг хүсэн ерөөе.</p>', 1, 1),
(18, 'Ховд, Баян-Өлгий, Говь-Алтай аймгуудын МСҮТ, Политехник коллежийн үйл ажиллагаатай танилцав.', '20231130092235', '2023-11-30 09:24:43', '<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/tfe/2/16/1f1f2_1f1f3.png\" alt=\"🇲🇳\" height=\"16\" width=\"16\">Боловсрол шинжлэх ухааны сайдтай байгуулсан захирлын үр дүнгийн гэрээ, байгууллагын 2023 оны гүйцэтгэлийн төлөвлөгөөнд тусгагдсан арга хэмжээг хэрэгжүүлэх зорилгоор багш, ажилтнуудыг ижил төстэй үйл ажиллагаа явуулдаг сургуулиудын сайн туршлагаас суралцуулах, шинэ техник технологитой танилцуулах, харилцан туршлага солилцон мэдлэг ур чадвараа нэмэгдүүлэх, дэмжлэг үзүүлэх зорилгоор </p><p><span style=\"background-color: transparent; color: var(--accent);\">Өвөрхангай аймаг дахь Политехник Коллеж</span>ийн туршлага судлах баг Ховд, Баян-Өлгий, Говь-Алтай аймгуудын МСҮТ, Политехник коллежийн хичээл сургалтын үйл ажиллагаатай танилцлаа.</p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t63/2/16/270d.png\" alt=\"✍️\" height=\"16\" width=\"16\">Ижил төстэй байгууллагуудын олон талт хамтын ажиллагаа сайжруулах талаар болон хөгжлийн менежментээ хуваалцаж,  инновацлаг, бүтээлч сургалтын орчны үйл ажиллагаатай танилцаж харилцан туршлага солилцов.</p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/tf7/2/16/1f929.png\" alt=\"🤩\" height=\"16\" width=\"16\">Биднийг халуун дотноор хүлээн авсан <span style=\"background-color: transparent; color: var(--accent);\">Ховд аймаг дахь Хөгжил Политехник коллеж</span>, <span style=\"background-color: transparent; color: var(--accent);\">Баян-Өлгий аймаг дахь МСҮТөв</span>, Говь-Алтай аймаг дахь МСҮТ-ийн хамт олондоо талархал илэрхийлж цаашдын ажил хөдөлмөрт нь амжилт хүсье.</p>', 1, 1),
(19, 'СУРГУУЛИЙН АВАРГА ШАЛГАРУУЛАХ САГСАН БӨМБӨГ, ВОЛЕЙБОЛЫН ТЭМЦЭЭН ЗОХИОН БАЙГУУЛАГДАВ.', '20231205142159', '2023-12-05 14:24:33', '<p>Өвөрхангай аймаг дахь Политехник Коллежийн 2.5 жилтэй 1,2,3 дугаар ангийн суралцагчдын дунд сургуулийн <span style=\"background-color: transparent; color: var(--accent);\">аварга</span> шалгаруулах сагсан бөмбөг, волейболын тэмцээнийг амжилттай зохион байгууллаа. </p><p>Тус тэмцээнд нийт 58 баг оролцсоноос  </p><p>Эрэгтэй волейболын төрөлд:  </p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t5d/2/16/1f3c6.png\" alt=\"🏆\" height=\"16\" width=\"16\">Тэргүүн байранд “Барилгын цахилгаанчин” мэргэжлийн С.Ариунболд багштай 3-1 дүгээр анги  </p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/tb4/2/16/1f948.png\" alt=\"🥈\" height=\"16\" width=\"16\">Дэд байранд “Хүнд машин механизмын засварчин” мэргэжлийн Ч.Наранцэцэг багштай 3-5 дугаар анги </p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t35/2/16/1f949.png\" alt=\"🥉\" height=\"16\" width=\"16\"> Гутгаар байранд “Хүнд машин механизмын засварчин” мэргэжлийн С.Болорзэс багштай 3-6 дугаар анги  </p><p>Эмэгтэй волейболын төрөлд:  </p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t5d/2/16/1f3c6.png\" alt=\"🏆\" height=\"16\" width=\"16\">Тэргүүн байранд “Хэвлэлийн график дизайнч” мэргэжлийн А.Цэцэгмаа багштай 3-10 дугаар анги  </p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/tb4/2/16/1f948.png\" alt=\"🥈\" height=\"16\" width=\"16\">Дэд байранд “Тогооч” мэргэжлийн Д.Наранцэцэг багштай 3-7 дугаар анги  </p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t35/2/16/1f949.png\" alt=\"🥉\" height=\"16\" width=\"16\">Гутгаар байранд “Компьютерын оператор” мэргэжлийн Т.Цэрэнбал багштай 3-9 дүгээр анги  </p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/tdc/2/16/1f3c5.png\" alt=\"🏅\" height=\"16\" width=\"16\">Шилдэг тоглогчоор 3-1 ангийн суралцагч Н.Энхбат, 3-10 ангийн суралцагч Т.Номин </p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/tdc/2/16/1f3c5.png\" alt=\"🏅\" height=\"16\" width=\"16\"> Шилдэг холбогчоор 3-6 ангийн суралцагч Э.Оргил, 3-9 ангийн суралцагч  </p><p>Эрэгтэй сагсан бөмбөгийн төрөлд:  </p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t5d/2/16/1f3c6.png\" alt=\"🏆\" height=\"16\" width=\"16\">Тэргүүн байранд “Хүнд машин механизмын засварчин” мэргэжлийн С.Болорзэс багштай 3-6 анги  </p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/tb4/2/16/1f948.png\" alt=\"🥈\" height=\"16\" width=\"16\">Дэд байранд “Авто машины засварчин\" мэргэжлийн Г.Бямбасүрэн 1-3 анги  </p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t35/2/16/1f949.png\" alt=\"🥉\" height=\"16\" width=\"16\">Гутгаар байранд \"Хүнд машин механизмын засварчин\" мэргэжлийн Ч.Наранцэцэг багштай 3-5 анги </p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/tdc/2/16/1f3c5.png\" alt=\"🏅\" height=\"16\" width=\"16\"> Шилдэг тоглогчоор 3-6 ангийн Б. Эрдэнэбаяр, 2-3 ангийн Д.Цэрэнням  </p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/tdc/2/16/1f3c5.png\" alt=\"🏅\" height=\"16\" width=\"16\">Шилдэг холбон тоглогчоор 1-3 ангийн суралцагч Ш.Мөнхбаяр, 3-7 Г.Лхамхорол нар тус тус шалгарлаа.  </p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/tf7/2/16/1f929.png\" alt=\"🤩\" height=\"16\" width=\"16\">Суралцагчдын тэмцээнийг ивээн тэтгэсэн \"Онолт өшгөг ХХК\"-ий захирал А.Мөнхбаяр, \"Хүлэг\" дэлгүүрийн эзэн Эрдэнэхишиг, П.Нарантуяа нартаа талархал илэрхийлж, ажлын өндөр амжилт хүсье.  </p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t89/2/16/1f970.png\" alt=\"🥰\" height=\"16\" width=\"16\">Анги хамт олноороо идэвхтэй оролцсон нийт суралцагч нартаа болон зохион байгуулагч нартаа талархал илэрхийлэн, цаашдын тэмцээн уралдаанд нь өндөр амжилт хүсэн ерөөе.  <img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/tfe/2/16/1f1f2_1f1f3.png\" alt=\"🇲🇳\" height=\"16\" width=\"16\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/tfe/2/16/1f1f2_1f1f3.png\" alt=\"🇲🇳\" height=\"16\" width=\"16\">БИЕИЙН ТАМИР МАНДТУГАЙ<img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/tfe/2/16/1f1f2_1f1f3.png\" alt=\"🇲🇳\" height=\"16\" width=\"16\"></p>', 1, 1),
(20, 'ИД ШИДТЭЙ АНГИУДАА АЛДАРШУУЛЬЯ', '20231212105623', '2023-12-12 10:57:28', '<p>Хүүхэд багачууд залуучуудын чөлөөт цаг зөв боловсон өнгөрүүлэх, сургалт, хүмүүжил оюуны чадамжийг бий болгох зорилттой Ид шидийн орон Өвөрхангай төсөлд манай сургуулийн хүүхдүүд нэгдэж, үйл ажиллагаанд санаачилгатай оролцдог билээ.</p><p>Энэ удаад 5 Тивийн 17 улсаас 22 навч болон шагналтай \"TRIO\" киног анги хамт олноороо үзэж, Ид шидтэй анги болсон</p><p>1. Б.Ганбаатар багштай 1-6 ангийн хамт олон</p><p>2. Х.Дуламсүрэн багштай 1-7 ангийн хамт олон</p><p>3. Т.Чулуунцэцэг багштай 1-10 ангийн хамт олон</p><p>4. Л.Долгоржав багштай 1-12 ангийн хамт олон</p><p>5. Л.Гандолгор багштай 2-7 ангийн хамт олон</p><p>6. Г.Цэвэлмаа багштай 3-2 ангийн хамт олон</p><p>7. А.Цэцэгмаа багштай 3-10 ангийн хамт олон</p><p>8. Ш.Энхзаяа багштай 1-22 ангийн хамт олон</p><p>Нартаа талархаж, сайн үйлсийн аяны зам нь дардан байхын ерөөл өргөе!</p>', 1, 1),
(21, 'ТОГООЧ МЭРГЭЖЛИЙН СУРГАЛТ ЗОХИОН БАЙГУУЛАГДАВ', '20231212110023', '2023-12-12 11:00:49', '<p>Монгол Улсын Засгийн газраас газраас хэрэгжүүлж буй халамжаас хөдөлмөрт бодлогын хүрээнд Өвөрхангай аймгийн Засаг даргын дэргэдэх Хөдөлмөр халамж, үйлчилгээний газрын захиалгаар Тогооч мэргэжлийн хугацааны сургалт зохион байгуулагдаж, Арвайхээр сумын 16 эмэгтэйчүүд хамрагдлаа. </p><p>Энэхүү сургалтыг Монгол Улсын тэргүүлэх багш Ц.Гандиймаа удирдаж,  шавь нар 60-д  төрлийн хоол хийж сурсан үр дүнгээр сургалтаа өндөрлүүлжээ.</p>', 1, 1),
(22, 'БУЯН БУЦАЖ ИРЭХДЭЭ БОРОО ШИГ АСГАРДАГ', '20231212110118', '2023-12-12 11:01:56', '<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/tb4/2/16/2705.png\" alt=\"✅\" height=\"16\" width=\"16\">Өвөрхангай аймаг дахь Политехник коллежийн Өсвөрийн улаан загалмайн “Тусч” клубийн суралцагчид ээлжит сайн үйлсийн аяндаа нэгджээ.</p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/tb4/2/16/2705.png\" alt=\"✅\" height=\"16\" width=\"16\"> Х.Дуламсүрэн багштай Тогооч мэргэжлийн 1-8 ангийн суралцагчид Арвайхээр сумын 10 дугаар багийн өндөр настан Гочоо эмээгийн гэр орон, хашаа хороог нь цэвэрлэх, түлээ түлшийг нь хагалж, хураах, ус авах, гурил таслах, мах хэрчих зэрэг ажлуудыг хийж тусалсан байна. </p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/tb4/2/16/2705.png\" alt=\"✅\" height=\"16\" width=\"16\">Тусч клубийнхэн маань “Өөрөөсөө илүүчлэн бусдад” аяны хүрээнд цуглуулсан хоол хүнсээ Гочоо гуайд бэлэглэж сэтгэлийн дэм тус өгсөн байна.</p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/tb4/2/16/2705.png\" alt=\"✅\" height=\"16\" width=\"16\">Сайн үйлсийн аянд идэвхтэй оролцсон клубийн багш, суралцагчдадаа талархал илэрхийлье.</p>', 1, 1),
(25, 'ШИЛДЭГ ФАЙЛ ШАЛГАРУУЛАХ УРАЛДААН ЗОХИОН БАЙГУУЛАГДАЖ', '20240104173534', '2023-12-24 00:00:00', '<p>✅СУРГУУЛИЙН УДИРДАХ ЗӨВЛӨЛИЙН ДАРГЫН НЭРЭМЖИТ “ШИЛДЭГ ФАЙЛ” ШАЛГАРУУЛАХ УРАЛДААН ЗОХИОН БАЙГУУЛАГДАЖ ШАГНАЛЫГ ГАРДУУЛАВ.&nbsp;</p><p>✅Багш нарын хичээлийн файлын сан бүрдүүлэлтийн эмх цэгцийг хангах, багш нарын бүтээлч сэтгэлгээг хөгжүүлэх, сургалтын агуулга, арга зүйд нийцсэн гарын авлага боловсруулах, сургалтын чанар хүртээмжийг сайжруулах зорилгоор сургуулийн нийт багш нарыг хамруулсан “шилдэг файл” шалгаруулах уралдаанд</p><p>Тэргүүн байранд Оёдлын багш Б.Батхишиг</p><p>Дэд байранд Барилгын багш Ж.Найгалмаа</p><p>Гутгаар байранд&nbsp;Монгол хэл, уран зохиолын багш Ч.Наранцэцэг</p><p>👏Уралдаанд оролцсон нийт багш нартаа амжилт хүсье.</p>', 1, 1),
(26, 'ОНЫ ШИЛДЭГ БАГШ, АЖИЛТНУУДДАА БАЯР ХҮРГЭЕ', '20240104173703', '2023-12-24 00:00:00', '<p>Боловсрол шинжлэх ухааны яамны харьяа Магадлан итгэмжлэгдсэн Өвөрхангай аймаг дахь Политехник Коллеж 2023 онд бид амжилт бүтээлээр арвин хуучин оноо үдэж байна.&nbsp;</p><p>ОНЫ ШИЛДЭГ багш ажилтнаар:</p><p>2023 оны сургуулийн шилдэг багшаар&nbsp;арьсаар гар урлаач мэргэжлийн багш Ц Алтангэрэл, англи хэлний багш С Болорзэс</p><p>2023 оны сургуулийн шилдэг ажилтнаар ХАБЭАХариуцсан ахлах ажилтан Ц Батжаргал, Жижүүр Л Дашмаа</p><p>ЗАХИРЛЫН НЭРЭМЖИТ ШАГНАЛААР:</p><p>1.Арга зүйч багш Г.Тунгалаг</p><p>2.Оёмол бүтээгдэхүүний оёдолчин мэгэжлийн багш&nbsp;</p><p>С. Санжидхорол</p><p>3.Мэдээллийн технологийн багш Т. Пагамдулам</p><p>4.Биеийн тамирын багш А.Нармандах</p><p>5.Оёмол бүтээгдэхүүний оёдолчин мэгэжлийн багш Б.Батхишиг</p><p>6.Жолооны багш Б.Раднаа</p><p>7.Мэдээллийн технологийн багш Ж.Бат-ирээдүй</p><p>8.Эдийн засгийн багш Г.Оюунцэцэг</p><p>9.Гоо заслын багш Ш.Энхзаяа</p><p>10.Хоол үйлдвэрлэлийн технологийн агш Д.Нямсүрэн</p><p>11.Биеийн тамирын багш П.Содномцоо</p><p>12.Англи хэлний багш Ц.Энхтуул</p><p>13.Барилгын багш Б.Гандөш</p><p>14.Уул, уурхайн машин, тоног төхөөрөмжийн механикийн багш О.Цогтсайхан</p><p>15.Тогооч Ч.Ононбаяр</p><p>16.Дадлагын газрын зохион байгуулагч С.Намбарнанзад</p><p>17.Үйлчлэгч Ж.Цэрэннадмид</p><p>18.Жижүүр Ц.Ёндонжунай</p><p>19.Үйлчлэгч Ц.Цэндмаа</p><p>20.Слесарь С.Батзориг нар</p><p>МОНГОЛ УЛСЫН ЗАСГИЙН ГАЗРЫН ШАГНАЛ БОЛОВСРОЛЫН ТЭРГҮҮНИЙ АЖИЛТАН- наар багш Д.Наранцэцэг, С.Болорзэс, Т.Гандиймаа, О.Гиваапил, Ж.Найгалмаа, С.Баасансүрэн, Т.Цэндсүрэн нар</p><p>ҮЙЛДВЭР ХУДАЛДАА ҮЙЛЧИЛГЭЭНИЙ ТЭРГҮҮНИЙ АЖИЛТАН – П.Үржинханд,</p><p>БОЛОВСРОЛ ШИНЖЛЭХ УХААНЫ ЯАМНЫ ЖУУХ БИЧИГ ээр&nbsp;багш Г.Цэвэлмаа,, Г.Бямбасүрэн нар</p><p>АЙМГИЙН ЗАСАГ ДАРГЫН ЖУУХ БИЧИГээр Б.Очирбат,</p><p>АЙМГИЙН ЗАСАГ ДАРГЫН ТАМГЫН ГАЗРЫН ЖУУХ БИЧИГ ээр Л.Дашмаа нар шагнагдлаа.</p><p>Шагнал авсан нийт багш, ажилтнууддаа Өвөрхангай аймаг дахь Политехник Коллежийн нийт хамт олноос нь халуун баяр хүргэж, ирэх ондоо амжилтаа бататган илүү ихийг хийж бүтээхийн арвин их амжилтыг хүсэн ерөөе!</p>', 1, 1),
(27, '“БҮТЭЭЛЧЭЭР ТҮҮЧЭЭЛЬЕ” тайлант өдөрлөг амжилттай болж өндөрлөлөө.', '20240104174354', '2023-12-20 00:00:00', '<p>✅“БҮТЭЭЛЧЭЭР ТҮҮЧЭЭЛЬЕ” тайлант өдөрлөг амжилттай болж өндөрлөлөө.&nbsp;</p><p>Өвөрхангай аймаг дахь Политехник Коллеж-ийн суралцагчид сурагч нас, дүрэмт хувцсаараа гоёцгооё уриан дор “Бүтээлчээр түүчээлье” оролцоонд суурилсан тайлант өдөрлөгийг зохион байгуулж, 2023 оны ололт амжилтаа дүгнэлээ.&nbsp;</p><p>✅Тайлант өдөрлөгийн үеэр оны шилдэг манлайлагч хүүхдүүдээ тодруулан, урлаг спортын шилдэг суралцагчид, шилдэг анги, тасаг хамт олноо өргөмжилсөн байна.&nbsp;</p><p>✅2023 оны Захирлын нэрэмжит ур чадварын уралдаанд тэргүүлсэн 9 мэргэжлийн аваргуудыг онцлон, 3-р курсийн төгсөгч 54 хүүхдэд ажлын байрын урилга гардууллаа.&nbsp;</p><p>✅Зэвсэгт хүчний ..р ангийн суралцагч цэргүүд маань сургуультайгаа танилцах аяллыг зохион байгуулж, хамтын ажиллагаагаа өргөтгөсөн байна.&nbsp;</p>', 1, 1),
(29, 'Техникийн боловсрол олгох дипломын ангид дараах мэргэжлүүдээс сонгон суралцахыг урьж байна.', '20240108185834', '2024-01-08 00:00:00', '<p>Өвөрхангай аймаг дахь Политехник Коллеж Техникийн боловсрол олгох дипломын ангид дараах мэргэжлүүдээс сонгон суралцахыг урьж байна.</p><p>Та манай сургуульд суралцсанаар дараах хөнгөлөлт урамшуулалд хамрагдах боломжтой.</p><p>1. Тэтгэлэг- сар бүрийн 200000 төгрөг буюу төгсөхдөө 3000000 төгрөг авах</p><p>2. Дотуур байранд үнэгүй амьдрах</p><p>3. Жолооны курст хөнгөлөлттэй суралцах</p><p>4. Ур чадварын уралдаанд амжилттай оролцсон бол төлбөрийн хөнгөлөлт эдлэх</p><p>5. Кредит дүйцүүлэх</p><p>6. Япон хэлний сургалтад үнэгүй сурах</p><p>7. Гадаадын хамтран ажилладаг байгууллагуудад дадлагажигчаар ажиллах</p><p>8. Их дээд сургуульд кредит дүйцүүлэн дэвшин суралцах</p><p><br></p><p>ЧАДВАРЛАГ БАГШ, ЧАНАРТАЙ СУРГАЛТЫН ОРЧИН ТАНЫГ ХҮЛЭЭЖ БАЙНА</p>', 1, 1),
(30, '\"АЛТАН САРНАЙ-2023\" ОНЫ ТЭРГҮҮН НААДАМ', '20240104173422', '2023-12-25 00:00:00', '<p>✅Өвөрхангай аймаг дахь Политехник Коллежийн \"ЭКО СУРГУУЛЬ\" төсөлт ажил АЛТАН САРНАЙ-н эзэн болов.</p><p>Энэ наадмын үеэр:&nbsp;&nbsp;</p><p>✅Монголын Залуучуудын холбооны \"Тэргүүний залуу\" цол тэмдгээр Ц.Батжаргал&nbsp;</p><p>✅Социал Демократ Монголын Залуучуудын холбооны \"Нийгмийн ардчиллын төлөө\" медалиар Ч.Эрдэнэтогтох нар тус тус шагнагдлаа.</p><p>👏Шагнал авсан ажилтнууддаа баяр хүргэе.</p>', 1, 1),
(31, 'Суралцагчид илтгэлийн уралдаанд оролцлоо', '20240109153052', '2023-12-26 00:00:00', '<p>Японы Хүүхдийг ивээх сангийн Өвөрхангай аймаг дахь салбартай хамтран  хүүхдээс хүүхдэд зөв хандлага, зөв дадал хэвшил, зөөлөн ур чадварыг төлөвшүүлэх хүрээнд \"Зөөлөн ур чадвар миний амьдралд\" илтгэлийн тэмцээн амжилттай зохион байгуулагдав.</p><p>1-р байранд нарийн бичгийн дарга албан хэргийн ажилтан 1-10 ангийн суралцагч Б.Оюун-Эрдэнэ</p><p>2-р байранд  компьютерийн оператор мэргэжлийн 2-9 ангийн суралцагч Б.Пүрэвбат</p><p>3-р байранд Оёмол бүтээгдэхүүний оёдолчин мэргэжлийн 3-8 ангийн суралцагч Б.Мягмарнаран</p><p>Тусгай байранд хэвлэлийн график дизайнч мэргэжлийн 2-3 ангийн суралцагч Г. Мөнхнаран, тогооч мэргэжлийн 1-8 ангийн суралцагч Л.Эрдэнэсувд нар тус тус шалгарлаа.</p><p>Тэмцээнд оролцсон суралцагчдадаа амжилт хүсье.</p>', 1, 1),
(32, 'Түншлэгч байгууллагуудын волейболын тэмцээн', '20240110110946', '2024-01-10 00:00:00', '<p><span style=\"color: rgb(5, 5, 5);\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t57/1/16/1f3d0.png\" alt=\"🏐\" height=\"16\" width=\"16\">Түүхт 50 жилийн ойн хүрээнд түншлэгч байгууллагуудын дунд зохион байгуулж буй волейболын тэмцээнд та бүхнийг баг, хамт олноороо хүрэлцэн ирэхийг урьж байна.</span></p>', 1, 1),
(33, 'ЭХ ДЭЛХИЙ-ЭХ НУТАГ ӨДӨРЛӨГ ЗОХИОН БАЙГУУЛАГДАВ.', '20240215153942', '2024-02-07 00:00:00', '<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/tac/1/16/1f4cc.png\" alt=\"📌\" height=\"16\" width=\"16\">Тогтвортой хөгжилд орон нутгийн хөгжлийн бэрхшээлтэй иргэдийн оролцоог нэмэгдүүлэх, төрийн ажил үйлчилгээг ойртуулах, байгаль орны өнөөгийн нөхцөл байдалд хувь хүний оруулах эерэг хандлагыг өсгөх зорилго бүхий  “ЭХ ДЭЛХИЙ-ЭХ НУТАГ” зорилтод байгаль хамгаалал, хөгжүүлэх өдөрлөгийг тус сургуулийн Эко зөвлөл хамтран зохион байгуулав.</p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" height=\"16\" width=\"16\">Өдөрлөгийн хүрээнд үсчин, гоо сайхны үйлчилгээ үзүүлж, хуучин хувцсаар дахин боловсруулалт хийж нийт 150 орчим хүмүүст үйлчиллээ.</p>', 1, 1),
(34, 'Өвөрхангай Боловсрол, шинжлэх ухааны газар зөвлөн тусалж ажиллав', '20240221093603', '2024-02-21 00:00:00', '<p><span style=\"color: rgb(5, 5, 5);\">2023-2024 оны хичээлийн жилийн зорилго, зорилтын хэрэгжилт, хичээл сургалтын үйл ажиллагааны зохион байгуулалттай танилцах, удирдах ажилтан багш нарт мэргэжил арга зүйн зөвлөгөө зөвлөмж өгөх, хамтын ажиллагааг бэхжүүлэх, цаашид хэрэгжүүлэх ажлын чиглэлээ тодорхойлох зорилгоор </span><a href=\"https://www.facebook.com/uvbsug?__cft__[0]=AZV7Pv5aLskXKiZua5nu1kQ49Fd783pNFTIEvQESWjSM_C4Ggw8OwFSpu_xu4N0rwQy2z5FUYOuO8mN6G_-4RNEb5yLW2Nbzy2Moy_09Gy1yFi16qHo0AcPNHB882eq_zpIB-ZvZ6zAPMdMeQXpNQ1HF2h9-XYuZdZua2kg5K2nvlanK0NCIsuFCUsDcw8Ajfo8&amp;__tn__=-]K-R\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--blue-link); background-color: transparent;\">Өвөрхангай Боловсрол, шинжлэх ухааны газар</a><span style=\"color: rgb(5, 5, 5);\"> хоёр өдрийн турш сургуулийн үйл ажиллагаа, багш нарын заах арга зүйтэй танилцан, зөвлөн тусалж ажиллав.</span></p>', 1, 1),
(35, 'PITCH EVENT зохион байгуулагдав', '20240306150627', '2024-03-06 00:00:00', '<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t76/1/16/1f1ef_1f1f5.png\" alt=\"🇯🇵\" height=\"16\" width=\"16\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t9f/1/16/1f1f2_1f1f3.png\" alt=\"🇲🇳\" height=\"16\" width=\"16\">Японы Хүүхдийг Ивээх Сангийн хэрэгжүүлж буй “Орон нутгийн өсвөр үеийнхэнд хувь хүний ур чадвар, энтрепренершип боловсрол олгох\" төсөл хөтөлбөрийн <span style=\"background-color: transparent; color: var(--blue-link);\">PITCH EVENT</span> зохион байгуулагдав.</p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" height=\"16\" width=\"16\">Тус <span style=\"background-color: transparent; color: var(--blue-link);\">PITCH EVENT</span>-д <a href=\"https://www.facebook.com/uvcollege?__cft__[0]=AZVkHpvMaZmte4TBAGnJwMEeObgrAnVXDBJfr1UB6ExarovFTVC-66aDH__PksThEMIYHllkvlafiaXFyvi9Uh0-YmjKLfuASgOPCzZ1rGbYS6EBHGt4fYU5cI1qDNuizVgNvfN0BHJASlyDfBSvFL47sh2i3hxvNd0nVIIZN0G0OJ1gJDeOwKBgOJO_O_Xg5dw&amp;__tn__=-]K-R\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"background-color: transparent; color: var(--blue-link);\">Өвөрхангай аймаг дахь Политехник Коллеж</a>ийн 3 баг төслөө  амжилттай танилцууллаа.</p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" height=\"16\" width=\"16\">Мөн хүрэлцэн ирж, бизнесийн туршлагаасаа үнэтэй зөвлөгөө өгсөн \"Барт хүрээ\" ТББ-н тэргүүн Л.Манлайбадрах. \"Өршөөлт хайрхан хан \" ХХК-ны захирал Б.Очирбат нартаа талархал илэрхийлье. </p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/tfe/1/16/1f44f.png\" alt=\"👏\" height=\"16\" width=\"16\">Та бүхний цаашдын ажил үйлст амжилт хүсьe.</p>', 1, 1),
(36, 'Хүндрэлийг хамтдаа 10,000 нэмнээ', '20240306150811', '2024-03-05 00:00:00', '<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" height=\"16\" width=\"16\"> Монголын Эмэгтэйчүүдийн Холбооноос үндэсний хэмжээнд зарласан “Хүндрэлийг хамтдаа 10,000 нэмнээ” аянд  нэгдлээ</p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t2d/1/16/1f4cd.png\" alt=\"📍\" height=\"16\" width=\"16\">Тус сургуулийн оёдлын техник технологич, оёмол бүтээгдэхүүний оёдолчин мэргэжлийн оюутан суралцагчид, багш нар малчдад 55 бээлий хийж, хандивлалаа.</p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t2d/1/16/1f4cd.png\" alt=\"📍\" height=\"16\" width=\"16\">Энэхүү үйл ажиллагааг дэмжиж ажилласан Өвөрхангай аймгийн эмэгтэйчүүдийн зөвлөлийн тэргүүлэгч, Элбэг худалдааны төвийн захирал Т.Батням танд талархал илэрхийлье</p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/tfe/1/16/1f44f.png\" alt=\"👏\" height=\"16\" width=\"16\">Буян буцаж ирэхдээ бороо шиг асгардаг.</p>', 1, 1),
(37, 'Хүрэл гэрэгэ өргөмжлөлөө гардан авлаа', '20240322121707', '2024-03-22 00:00:00', '<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/tc0/1/16/1f30e.png\" alt=\"🌎\" height=\"16\" width=\"16\">Дэлхийн нийтийн тогтвортой хөгжлийн 17 зорилго, “Алсын хараа-2050” Монгол Улсын урт хугацааны хөгжлийн хэрэгжилтийг хангах ногоон хөгжил, тогтвортой хөгжлийн боловсролыг түгээн дэлгэрүүлэх ISO14001 стандартад суурилсан, Олон улсын эко сургууль/цэцэрлэг хөтөлбөрийн үндэсний VIII чуулганд Политехник коллежийн багш, ажилтан, суралцагч хамрагдаж Хүрэл гэрэгэ өргөмжлөлөө гардан авлаа.</p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" height=\"16\" width=\"16\">Ногоон хөгжил, тогтвортой хөгжлийн боловсролын үзэл санааг сургалтын агуулга, арга зүй, байгууллагын үйл ажиллагаанд нэвтрүүлэн ажиллаж байна.</p>', 1, 1),
(38, 'ХАМТЫН АЖИЛЛАГААНЫ САНАМЖ БИЧИГ БАЙГУУЛАВ', '20240322121841', '2024-03-18 00:00:00', '<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/tac/1/16/1f4cc.png\" alt=\"📌\" height=\"16\" width=\"16\">Монгол улс БНХАУ-тай дипломат харилцаа тогтоосны 75 жил, Өвөрхангай аймаг БНХАУ-ын Гүйжөү мужтай найрамдалт хамтын ажиллагаа тогтоосны 8 жилийн ойн хүрээнд  Гүйжөү мужийн Хөдөө аж ахуйн мэргэжлийн коллежтой хамтын ажиллагааны Санамж бичиг байгуулав.</p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/tac/1/16/1f4cc.png\" alt=\"📌\" height=\"16\" width=\"16\">Найрамдалт хамтын ажиллагааны хүрээнд Өвөрхангай аймгийн малын эмч нарыг чадавхжуулах төслийг амжилттай хэрэгжүүлж байсан туршлагатай Гүйжөү мужийн Хөдөө аж ахуйн мэргэжлийн коллежтой байгуулсан Санамж бичгийн хүрээнд дараах төслүүдийг хэрэгжүүлэх юм. Үүнд:</p><p>-Хоёр талын багш менежер, шинжлэх ухааны судлаачдын харилцан айлчлал, солилцоог дэмжих;</p><p>-Экологийн хөдөө аж ахуй, мал эмнэлэг, цахим худалдаа, хүнсний үйлдвэрлэл зэрэг чиглэлээр суралцаж буй оюутнуудыг харилцан айлчлал, солилцоо, хамтын ажиллагааны сургалтыг дэмжих;</p><p>-Хоёр талын хамтын ажиллагааны чиглэл, эсвэл сонирхсон сэдвээр эрдэм шинжилгээ, судалгаа, мэдээлэл хуваалцахыг дэмжих зэрэг төслүүдийг хэрэгжүүлэх юм.</p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/tac/1/16/1f4cc.png\" alt=\"📌\" height=\"16\" width=\"16\">Санамж бичиг байгуулахад Өвөрхангай аймгийн Засаг дарга бөгөөд Өвөрхангай аймаг дахь Политехник коллежийн Удирдах зөвлөлийн дарга И.Доржсүрэн, Удирдах зөвлөлийн гишүүн, Ажил олгогч эздийн нэгдсэн холбооны Өвөрхангай аймаг дахь салбарын дарга О.Гансүх нар байлцлаа.</p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/tfe/1/16/1f44f.png\" alt=\"👏\" height=\"16\" width=\"16\">Өвөрхангай аймагт мэргэжилтэй ажилтныг бэлтгэх, мэргэжлийн болон техникийн сургалтын байгууллагыг дэмжин ажиллаж буй Удирдах зөвлөлийн хамт олонд талархал илэрхийлье.</p>', 1, 1),
(39, 'Багш ажилтнуудын дунд Урлагийн бага наадам болж өндөрлөлөө', '20240330121921', '2024-03-30 00:00:00', '<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/tae/1/16/1f3ad.png\" alt=\"🎭\" height=\"16\" width=\"16\">Тус сургуулийн багш ажилтнуудын дунд Урлагийн бага наадам болж өндөрлөлөө.</p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t40/1/16/1f4a5.png\" alt=\"💥\" height=\"16\" width=\"16\">Энэхүү наадмыг  О. Цогтсайхан ахлагчтай Уул уурхай, эдийн засгийн баг  урлагийн 5 төрлөөр  зохион байгуулж, бүх багууд идэвхтэй, бүтээлчээр оролцов. </p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/tcc/1/16/1f3bc.png\" alt=\"🎼\" height=\"16\" width=\"16\">Баг хамт олны чөлөөт цагийг зөв боловсон өнгөрүүлэх, багийн хамтач, бүтээлч хандлагыг дэмжих, авьяас чадварыг илрүүлэх зорилготой эл наадамд оролцсон бүх урлагийн авьяастнуудад баяр хүргэе<img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t21/1/16/1f3b8.png\" alt=\"🎸\" height=\"16\" width=\"16\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/ta0/1/16/1f3b7.png\" alt=\"🎷\" height=\"16\" width=\"16\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t8e/1/16/1f941.png\" alt=\"🥁\" height=\"16\" width=\"16\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t58/1/16/1fa98.png\" alt=\"🪘\" height=\"16\" width=\"16\"></p>', 1, 1),
(40, '50 жилийн ойн хүрээнд ахмад буурлуудаа хүндэтгэл үзүүллээ', '20240330122037', '2024-03-28 00:00:00', '<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/tac/1/16/1f4cc.png\" alt=\"📌\" height=\"16\" width=\"16\">Өвөрхангай аймаг дахь Политехник коллеж байгуулагдсан түүхт 50 жилийн ойн хүрээнд ахмад буурлуудаа хүндэтгэх, түүх хүүрнэх, ном зохиол бичих оюунлаг ажлуудыг тус сургуулийн хамт олноос зохион байгуулж байгаа юм.</p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/tac/1/16/1f4cc.png\" alt=\"📌\" height=\"16\" width=\"16\">Энэ удаад 1974 оны анхны захирал Гялдангийн Самданцоодол багшийн гэргий Майдарзавын Лхамсүрэн, 1985-1995 онуудад захирлаар ажиллаж байсан Дэедийн Пүрэв, 2000-2010 онд захирлаар ажиллаж байсан Жавчивсэнгийн Жанцандорж болон УАА-н ТМС, ТМДС-уудад ажиллаж байсан үе үеийн ахмад ажилтнуудын төлөөлөл 40 гаруй багш ажилтнуудтай уулзав.</p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/tfe/1/16/1f44f.png\" alt=\"👏\" height=\"16\" width=\"16\">Биднийг халуун дотноор хүлээн авч, сургуулийн түүхэн замналын дурсамжийг хөглөн, бүтээн байгуулалт, хөгжил дэвшлийн хууч хөөрч, залууст урам хайрласан эрхэм Та бүхэндээ болон уулзалтыг зохион байгуулсан Ойдовын Чимэдцэрэн тэргүүтэй ахмад багш нартаа талархал илэрхийлье.</p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t9f/1/16/1f1f2_1f1f3.png\" alt=\"🇲🇳\" height=\"16\" width=\"16\">Сургуулийнхаа 50 дахь хичээлийн жилээр өргөн дэлгэр, баяр хөөр дүүрэн уулзахын ерөөл тавьж байна.</p>', 1, 1),
(41, 'БАГШИЙН ТАСРАЛТГҮЙ ХӨГЖЛИЙГ ДЭМЖИН АЖИЛЛАЖ БАЙНА', '20240330122149', '2024-03-27 00:00:00', '<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/tac/1/16/1f4cc.png\" alt=\"📌\" height=\"16\" width=\"16\">Боловсролын Шинэ сэргэлтийн хүрээнд хөтөлбөрийн шинэчлэл, багшийн хөгжлийг хангах зорилтот ажлууд тус сургууль дээр үргэлжилж байна. Энэ удаагийн сургалтаар багшийг ажлын байран дээр хөгжүүлэх, насан туршдаа суралцахуйг дэмжих багц сургалтыг зохион байгуулж, Сургалтын албаны бүх багш ажилтнууд хамрагдав. </p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/tac/1/16/1f4cc.png\" alt=\"📌\" height=\"16\" width=\"16\">Сургалтын хөтөлбөрийг хүүхдийн эрхэд суурилан, тогтвортой хөгжилд ээлтэйгээр олон улсын хөгжлийн арга зүйд нийцүүлэн хөгжүүлэлт хийх чиглэлээр мэргэжлийн багтай хамтран ажилласан үр дүнт сургалт болж өндөрлөлөө.</p>', 1, 1),
(42, 'БАЯН-ӨЛГИЙ АЙМАГ ДАХЬ МЭРГЭЖЛИЙН БОЛОВСРОЛЫН СУРГУУЛИЙН БАГШ НАР СУРГУУЛИЙН ҮЙЛ АЖИЛЛАГААТАЙ ТАНИЛЦЛАА', '20240330122232', '2024-03-27 00:00:00', '<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/te2/1/16/270d.png\" alt=\"✍️\" height=\"16\" width=\"16\">Ижил төстэй байгууллагуудын олон талт хамтын ажиллагаа сайжруулах, хөгжлийн менежментээ хуваалцах ажлыг зохион байгууллаа.</p><p>Тус үйл ажиллагаанд зорин ирсэн Баян-Өлгий аймаг дахь Мэргэжлийн боловсролын сургуулийн багш нартаа талархал илэрхийлж, цаашдын ажилд нь өндрөөс өндөр амжилтыг хүсье.</p>', 1, 1),
(43, 'Эрэгтэй баг тамирчид ТЭРГҮҮН байрын эзэд боллоо', '20240408104644', '2024-04-08 00:00:00', '<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/tac/1/16/1f4cc.png\" alt=\"📌\" height=\"16\" width=\"16\">Боловсролын байгууллагын багш нарын хамтын үйл ажиллагааг сайжруулах, волейболын спортоор хичээллэх сонирхол, ур чадварыг нэмэгдүүлэх зорилгоор зохион байгуулагдсан ахмад багш Т.Чулуунбор агсны нэрэмжит 25 дахь удаагийн волейболын аварга шалгаруулах тэмцээнд тус сургуулийн Ц.Батжаргал ахлагчтай эрэгтэй баг тамирчид амжилттай оролцож ТЭРГҮҮН байрын эзэд боллоо.</p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/tac/1/16/1f4cc.png\" alt=\"📌\" height=\"16\" width=\"16\">Мөн тус тэмцээний ШИЛДЭГ ТОГЛОГЧООР Ц.Батжаргал тодров.</p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/tfe/1/16/1f44f.png\" alt=\"👏\" height=\"16\" width=\"16\">Баг тамирчдадаа нийт <a href=\"https://www.facebook.com/uvcollege?__cft__[0]=AZUDOXAmLIxUDksPbw6q4h1_TNvjQnjvNYgSPxAzpkQ2IU7uy9gigoXvfMzqhYhThEXRiLJEh08dYuD0T377awPbnRNB-PbzV1nqV0zLG7r_MTav-BnirRE21q_3WuQhZyfbhCai81rGmesFMe39kRFPfryReZJaLLlvSCuzOJyNxbaz3f2vLpFvmEKl1OAAkcU&amp;__tn__=-]K-R\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--blue-link); background-color: transparent;\">Өвөрхангай аймаг дахь Политехник Коллеж</a>ийн хамт олны зүгээс халуун баяр хүргэж, цаашдын уралдаан тэмцээнд нь амжилт хүсье.</p>', 1, 1);
INSERT INTO `news` (`id`, `title`, `image`, `ognoo`, `body`, `status`, `userid`) VALUES
(44, 'MINI YOUTH POWER IN COLLEGE\" БАЙГАЛЬД ЭЭЛТЭЙ СУРАЛЦАГЧДЫН ЧУУЛГА УУЛЗАЛТ ЗОХИОН БАЙГУУЛАГДАВ', '20240424065542', '2024-04-19 00:00:00', '<p>Өвөрхангай аймаг дахь Политехник коллежийн 1,2,3-р ангийн төлөөлөл болох нийт 70 орчим суралцагчид оролцсон \"Mini youth power in college\" байгальд ээлтэй залуусын чуулга уулзалтыг тус сургууль дээр зохион байгууллаа.</p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" height=\"16\" width=\"16\">Чуулга уулзалтаар суралцагчдад Монголын түүх, соёл уламжлалыг багийн ажиллагаагаар дамжуулан сурталчлах, байгаль орчноо хайрлан хамгаалах сэтгэлгээг суулгах, сургуулийн орчинд тулгамдаж буй асуудлыг хэлэлцэж, гарц шийдлийг тодорхойлон хэрэгжүүлэх зорилгоор үзэл бодлоо илэрхийлж уриалга гарган тунхаглалаа.</p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/tac/1/16/1f4cc.png\" alt=\"📌\" height=\"16\" width=\"16\">Mini Youth Power in College арга хэмжээний зочин илтгэгчээр <img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t72/1/16/1f538.png\" alt=\"🔸\" height=\"16\" width=\"16\">Өвөрхангай аймгийн Хужирт сумын Ерөнхий боловсролын 2-р сургуулийн 11а ангийн сурагч Цогтгэрэлийн Гэрэлсүрэн</p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/tac/1/16/1f4cc.png\" alt=\"📌\" height=\"16\" width=\"16\">Mini Youth Power in College арга хэмжээний чиглүүлэгчээр:</p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t72/1/16/1f538.png\" alt=\"🔸\" height=\"16\" width=\"16\">Өвөрхангай аймаг дахь Политехник коллежийн Хүнд машин механизмын засварчин мэргэжлийн ангийн суралцагч Д.Ганболд</p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t72/1/16/1f538.png\" alt=\"🔸\" height=\"16\" width=\"16\">Өвөрхангай аймгийн тарагт сумын ЕБС-ийн 11-р ангийн суралцагч Даваагийн Дэмчиг</p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t72/1/16/1f538.png\" alt=\"🔸\" height=\"16\" width=\"16\">Өвөрхангай аймгийн Арвайхээр сумын Ерөнхий боловсролын 4-р сургуулийн 11-р ангийн сурагч Ц.Сайнбилэг</p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t72/1/16/1f538.png\" alt=\"🔸\" height=\"16\" width=\"16\">Өвөрхангай аймгийн Арвайхээр сумын Ерөнхий боловсролын 1-р сургуулийн 11-р ангийн сурагч Г. Энхтүвшин</p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t72/1/16/1f538.png\" alt=\"🔸\" height=\"16\" width=\"16\">Өвөрхангай аймгийн Есөнзүйл сумын Ерөнхий боловсролын сургуулийн 12 ангийн сурагч Цэнд-Аюуш нар тус тус оролцлоо.</p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/tfe/1/16/1f44f.png\" alt=\"👏\" height=\"16\" width=\"16\">Үйл ажиллагааг санаачлан,  үлгэр дуурайлал үзүүлэн, зохион байгуулсан шавь нартаа болон, үе тэнгийн найз нөхдөө дэмжин хүрэлцэн ирж оролцсон зочин илтгэгч, чиглүүлэгч хүүхдүүддээ талархал илэрхийлье.  </p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t87/1/16/1f340.png\" alt=\"🍀\" height=\"16\" width=\"16\">MINI YOUTH POWER IN COLLEGE БАЙГАЛЬД ЭЭЛТЭЙ ЗАЛУУС</p>', 1, 1),
(45, 'Спортын их наадамд амжилттай оролцлоо', '20240424065726', '2024-04-15 00:00:00', '<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/tac/1/16/1f4cc.png\" alt=\"📌\" height=\"16\" width=\"16\"> Мэргэжлийн болон Техникийн боловсролын сургалтын байгууллагуудын нэр хүндийг өсгөх, хамтын ажиллагааг уялдуулан баяжуулах, хамт олонч байдлыг хөгжүүлэх, харилцан туршлага солилцох, багш ажиллагсдын эрүүл мэнд, бие бялдрыг чийрэгжүүлэх, спортын ур</p><p>чадварыг дээшлүүлэх, аварга баг шалгаруулах зорилгоор Дорнод аймаг дахь Политехник коллежийн түүхт 100 жилийн ойд зориулан зохион байгуулж буй МБС-н салбарын уламжлалт \"Спортын их наадам\"-д амжилттай оролцлоо.</p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/tac/1/16/1f4cc.png\" alt=\"📌\" height=\"16\" width=\"16\">Шатрын төрөлд:</p><p>С.Сэрчинбал Гутгаар байр.</p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t57/1/16/1f3d0.png\" alt=\"🏐\" height=\"16\" width=\"16\">Волейболын төрөлд:</p><p>Ц.Батжаргал ахлагчтай эрэгтэй баг тамирчид Гутгаар байр.</p><p>“Шилдэг холбогч”-оор А.Нармандах шалгарч тус тус бахдам амжилт үзүүллээ.</p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/tfe/1/16/1f44f.png\" alt=\"👏\" height=\"16\" width=\"16\">Баг тамирчдадаа нийт Өвөрхангай аймаг дахь Политехник Коллежийн хамт олны зүгээс халуун баяр хүргэж, цаашдын уралдаан тэмцээнд нь амжилт хүсье.</p>', 1, 1),
(46, 'Хөтөлбөрүүд амжилттай магадлан итгэмжлэгдлээ.', '20240424065935', '2024-04-10 00:00:00', '<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/te2/1/16/270d.png\" alt=\"✍️\" height=\"16\" width=\"16\">Мэргэжлийн болон техникийн боловсролын сургалтын хөтөлбөрийг магадлан итгэмжлэх комиссын 2024 оны 04-р сарын 08-ний өдрийн 2024/11-02,03 тоот тогтоолоор Өвөрхангай аймаг дахь <a href=\"https://www.facebook.com/uvcollege?__cft__[0]=AZV05dt0r7XNlD8w4-Bs3Llk6-NmAxEu7t_lBxJP0OQy82dA9T56ybnrC8vDW_8dccg4WdZOA2TIw3RiJE-qKJR_tHE5WM69Wfk9rrWOf8Z9ESRvSrTqr-Lf8OlHtW9vxby27Km_ekEMcVnWJm6EB8RNR96_Ypf9SeNA2bKWFH8BJ3A4Z4jdfcLZsB0OpEyn80Rq8vlkzvUdpIPro_xCXZ4P&amp;__tn__=-]K-R\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"background-color: transparent; color: var(--blue-link);\">Өвөрхангай аймаг дахь Политехник Коллеж</a> ийн “Хэвлэлийн график дизайнч” /AD7321-11/, “Барилгын засал-чимэглэлчин” /CF7123-20/ мэргэжлийн хөтөлбөрүүд тус бүр 5-н жилийн хугацаагаар амжилттай магадлан итгэмжлэгдлээ.</p><p><span style=\"color: rgb(5, 5, 5);\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/te2/1/16/270d.png\" alt=\"✍️\" height=\"16\" width=\"16\">Багаар, бүтээлчээр ажилласан дээрх мэргэжлийн багш нартаа, хамт олон, суралцагч, төгсөгч, ажил олгогч, хамтран ажиллагч байгууллага нэг бүрдээ халуун баяр хүргэе</span></p>', 1, 1),
(47, 'PISA-2025 ТУРШИХ ҮНЭЛГЭЭНД ХАМРАГДАВ', '20240424070103', '2024-04-09 00:00:00', '<p>ОЛОН УЛСЫН СУРЛАГЫН АМЖИЛТЫН ҮНЭЛГЭЭ PISA-2025 ҮНЭЛГЭЭНД ХАМРАГДАВ.</p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/tac/1/16/1f4cc.png\" alt=\"📌\" height=\"16\" width=\"16\">Олон улсын сурлагын амжилтын үнэлгээ РISA 2025 турших судалгаанд тус сургуулийн түүвэрт сонгогдсон 15 настай 84 суралцагчид, тэдний эцэг, эх, асран хамгаалагч болон сургуулийн удирдлага, байгалийн ухааны багш нар хамрагдлаа.</p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/ta/1/16/2696.png\" alt=\"⚖️\" height=\"16\" width=\"16\">PISA 2025 үнэлгээ нь манай улсын боловсролын чанар, үр дүнг олон улсын түвшинд үнэлэх, боловсролын талаар төрөөс баримтлах бодлого, чиглэл, төлөвлөлтийг тодорхойлоход ЧУХАЛ ҮҮРЭГ-тэй юм. </p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/te0/1/16/1f31f.png\" alt=\"🌟\" height=\"16\" width=\"16\">Суралцагч нартаа сурлагын өндөр амжилт хүсье.</p>', 1, 1),
(48, 'Шилдэг арга зүйтэй багш-2024 уралдаан зохион байгуулагдав', '20240508104641', '2024-05-06 00:00:00', '<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" height=\"16\" width=\"16\"><a href=\"https://www.facebook.com/uvcollege?__cft__[0]=AZVgDgteOObfCLpLRVb2fHmoC_YNATg0XNCevDl2nkY-WrWAvqwN32hSRpB2VF0NZXUMDqTKShseA3FDR_E65E3GLeE4Fwub25WuxGWxlsuGbn0sfTwt8NOnbkEko5Uu1y_JNAqtU9o9EGP8jP-vlqN9w6_xomvQ-4dQr0s5NFEZohLYB4jth9Os65dujS-d5n9gmHDrxGPQrrRcDH_W9J7s&amp;__tn__=-]K-R\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"background-color: transparent; color: var(--blue-link);\">Өвөрхангай аймаг дахь Политехник Коллеж</a>ийн Удирдах зөвлөлийн нэрэмжит ”Шилдэг арга зүйтэй багш-2024” уралдаан зохион байгуулагдав.</p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" height=\"16\" width=\"16\">Багшийн ур чадварыг хөгжүүлэх, ээлжит болон дадлага хичээлээр суралцагч нэг бүрийг төлөвшүүлэх, үр дүнд суурилсан сургалтын арга зүйн шилдэг технологийг түгээн дэлгэрүүлж, харилцан туршлага солилцох зорилгоор мэргэжлийн баг тус бүрээс 3 багш сонгон <a href=\"https://www.facebook.com/uvcollege?__cft__[0]=AZVgDgteOObfCLpLRVb2fHmoC_YNATg0XNCevDl2nkY-WrWAvqwN32hSRpB2VF0NZXUMDqTKShseA3FDR_E65E3GLeE4Fwub25WuxGWxlsuGbn0sfTwt8NOnbkEko5Uu1y_JNAqtU9o9EGP8jP-vlqN9w6_xomvQ-4dQr0s5NFEZohLYB4jth9Os65dujS-d5n9gmHDrxGPQrrRcDH_W9J7s&amp;__tn__=-]K-R\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"background-color: transparent; color: var(--blue-link);\">Өвөрхангай аймаг дахь Политехник Коллеж</a>ийн Удирдах зөвлөлийн нэрэмжит “Шилдэг арга зүйтэй багш-2024” уралдааныг 2 үе шаттайгаар зохион байгууллаа.</p><p><span style=\"background-color: transparent; color: var(--blue-link);\">Тэргүүн байранд</span> мэдээллийн технологийн багш Т.Пагамдулам</p><p><span style=\"background-color: transparent; color: var(--blue-link);\">Дэд байранд</span> авто механикийн багш Ц.Амарбаяр</p><p><span style=\"background-color: transparent; color: var(--blue-link);\">Гутгаар байранд</span> математикийн С.Гарамханд нар тус тус шалгарлаа.</p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/tfe/1/16/1f44f.png\" alt=\"👏\" height=\"16\" width=\"16\">Нийт оролцсон болон шагналт байранд шалгарсан багш нартаа халуун баяр хүргэ</p>', 1, 1),
(49, 'Ажилд ороход бэлэн үү? сэдвээр сургалт зохион байгууллаа', '20240508104835', '2024-05-02 00:00:00', '<p><span style=\"color: rgb(5, 5, 5);\">Суралцагчдад ажил, мэргэжлийн чиг баримжаа олгох, хөдөлмөрт бэлтгэх зорилгоор тус сургуулийн Мэргэжлийн боловсрол сургалтын 2-р ангийн суралцагчдад Хөдөлмөр халамж үйлчилгээний газартай хамтран \"Ажилд ороход бэлэн үү?\" сэдвээр сургалт зохион байгууллаа.</span></p>', 1, 1),
(50, 'Улсын XXI олимпиадад С.Болорзэс багш ГУТГААР байр эзэллээ', '20240508105000', '2024-04-27 00:00:00', '<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/tac/1/16/1f4cc.png\" alt=\"📌\" height=\"16\" width=\"16\">Үйлдвэр урлалын Политехник коллежийн нэрэмжит мэргэжлийн боловсрол, сургалтын байгууллагуудын багш, суралцагчдын англи хэлний улсын XXI олимпиадад нийт 21 сургуулийн 31 багш, 62 суралцагч оролцсоноос Өвөрхангай аймаг дахь Политехник Коллежийн англи хэлний багш, Монгол улсын заах аргач багш С.Болорзэс ГУТГААР байр эзэллээ.</p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/tfe/1/16/1f44f.png\" alt=\"👏\" height=\"16\" width=\"16\">Багшдаа нийт Өвөрхангай аймаг дахь Политехник Коллежийн хамт олны зүгээс халуун баяр хүргэе.</p>', 1, 1),
(51, 'БАЙГАЛЬД ЭЭЛТЭЙ СУРАЛЦАГЧДЫН ЧУУЛГА УУЛЗАЛТ ЗОХИОН БАЙГУУЛАГДАВ', '20240508105137', '2024-04-19 00:00:00', '<p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/tac/1/16/1f4cc.png\" alt=\"📌\" height=\"16\" width=\"16\">\"MINI YOUTH POWER IN COLLEGE\" БАЙГАЛЬД ЭЭЛТЭЙ СУРАЛЦАГЧДЫН ЧУУЛГА УУЛЗАЛТ ЗОХИОН БАЙГУУЛАГДАВ.<img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t14/1/16/2618.png\" alt=\"☘️\" height=\"16\" width=\"16\"></p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/tac/1/16/1f4cc.png\" alt=\"📌\" height=\"16\" width=\"16\">Өвөрхангай аймаг дахь Политехник коллежийн 1,2,3-р ангийн төлөөлөл болох нийт 70 орчим суралцагчид оролцсон \"Mini youth power in college\" байгальд ээлтэй залуусын чуулга уулзалтыг тус сургууль дээр зохион байгууллаа.</p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t33/1/16/2705.png\" alt=\"✅\" height=\"16\" width=\"16\">Чуулга уулзалтаар суралцагчдад Монголын түүх, соёл уламжлалыг багийн ажиллагаагаар дамжуулан сурталчлах, байгаль орчноо хайрлан хамгаалах сэтгэлгээг суулгах, сургуулийн орчинд тулгамдаж буй асуудлыг хэлэлцэж, гарц шийдлийг тодорхойлон хэрэгжүүлэх зорилгоор үзэл бодлоо илэрхийлж уриалга гарган тунхаглалаа.</p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/tac/1/16/1f4cc.png\" alt=\"📌\" height=\"16\" width=\"16\">Mini Youth Power in College арга хэмжээний зочин илтгэгчээр <img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t72/1/16/1f538.png\" alt=\"🔸\" height=\"16\" width=\"16\">Өвөрхангай аймгийн Хужирт сумын Ерөнхий боловсролын 2-р сургуулийн 11а ангийн сурагч Цогтгэрэлийн Гэрэлсүрэн</p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/tac/1/16/1f4cc.png\" alt=\"📌\" height=\"16\" width=\"16\">Mini Youth Power in College арга хэмжээний чиглүүлэгчээр:</p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t72/1/16/1f538.png\" alt=\"🔸\" height=\"16\" width=\"16\">Өвөрхангай аймаг дахь Политехник коллежийн Хүнд машин механизмын засварчин мэргэжлийн ангийн суралцагч Д.Ганболд</p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t72/1/16/1f538.png\" alt=\"🔸\" height=\"16\" width=\"16\">Өвөрхангай аймгийн тарагт сумын ЕБС-ийн 11-р ангийн суралцагч Даваагийн Дэмчиг</p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t72/1/16/1f538.png\" alt=\"🔸\" height=\"16\" width=\"16\">Өвөрхангай аймгийн Арвайхээр сумын Ерөнхий боловсролын 4-р сургуулийн 11-р ангийн сурагч Ц.Сайнбилэг</p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t72/1/16/1f538.png\" alt=\"🔸\" height=\"16\" width=\"16\">Өвөрхангай аймгийн Арвайхээр сумын Ерөнхий боловсролын 1-р сургуулийн 11-р ангийн сурагч Г. Энхтүвшин</p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t72/1/16/1f538.png\" alt=\"🔸\" height=\"16\" width=\"16\">Өвөрхангай аймгийн Есөнзүйл сумын Ерөнхий боловсролын сургуулийн 12 ангийн сурагч Цэнд-Аюуш нар тус тус оролцлоо.</p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/tfe/1/16/1f44f.png\" alt=\"👏\" height=\"16\" width=\"16\">Үйл ажиллагааг санаачлан,  үлгэр дуурайлал үзүүлэн, зохион байгуулсан шавь нартаа болон, үе тэнгийн найз нөхдөө дэмжин хүрэлцэн ирж оролцсон зочин илтгэгч, чиглүүлэгч хүүхдүүддээ талархал илэрхийлье.  </p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t87/1/16/1f340.png\" alt=\"🍀\" height=\"16\" width=\"16\">MINI YOUTH POWER IN COLLEGE БАЙГАЛЬД ЭЭЛТЭЙ ЗАЛУУС</p>', 1, 1),
(52, 'БҮГД НАЙРАМДАХ СОЛОНГОС УЛСЫН КЁОННАМ ИХ СУРГУУЛИЙН АЖЛЫН ХЭСЭГТЭЙ УУЛЗАЛТ ХИЙВ', '20240510153725', '2024-05-10 00:00:00', '<p>Сургуулийн удирдлага өнөөдөр Кёоннам Их сургуулийн дэд захирал Jae Youn Park-аар ахлуулсан ажлын хэсгийг хүлээн авч, уулзалт хийв.</p><p>Уулзалтаар 78 жилийн түүхтэй Кёоннам их сургуулийн ололт амжилт, олгож буй боловсролын тухай дэлгэрэнгүй танилцуулж, Өвөрхангай аймаг дахь Политехник Коллежийн сургалтын үйл ажиллагаа, дадлагын газар, анги танхимтай танилцан, суралцагч, төгсөгчдийн талаар харилцан мэдээлэл солилцлоо.</p><p>Кёоннам Их сургуулийн дэд захирал Jae Youn Park-ийг дагалдан Боловсрол судлалын доктор Minsu Kim, Гадаад харилцааны албаны ерөнхий захирал&nbsp;So Jin Lee, дэд захирал GeonYeong Go, мэргэжилтэн Jae Yeon Kim, Кёоннам их сургуулийн доктор профессор Монголыг хариуцсан ерөнхий удирдагч Ким Мин Су, Монгол талын зөвлөгч Б.Алтанцэцэг нар уулзалтад оролцлоо.</p>', 1, 1),
(53, 'Ур чадвар-2024 аймгийн анхдугаар уралдааныг зохион байгууллаа', '20240527085144', '2024-05-25 00:00:00', '<p>Өвөрхангай аймаг дахь Политехник Коллежийн түүхт <img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/tf6/1/16/35_20e3.png\" alt=\"5️⃣\" height=\"16\" width=\"16\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t5b/1/16/30_20e3.png\" alt=\"0️⃣\" height=\"16\" width=\"16\"> жилийн ойн хүрээнд  <span style=\"background-color: transparent; color: var(--blue-link);\">Хүлэмжийн аж ахуй эрхлэгчдийн</span> ур чадварыг сорих, чадавхжуулах, харилцан туршлага солилцох, хамтын ажиллагааг өргөжүүлэх зорилгоор \"Ур чадвар-2024\" аймгийн анхдугаар уралдааныг нийт төгсөгч, хуваариа хүлэмжийн аж ахуй эрхлэгчид, аж ахуй нэгж байгууллагуудын дунд амжилттай зохион байгууллаа. </p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/tac/1/16/1f4cc.png\" alt=\"📌\" height=\"16\" width=\"16\">Тус уралдаанд нийт 24 хүлэмжийн аж ахуй эрхлэгчид 8 баг болон ур чадвараа сорин өрсөлдсөнөөс:</p><p><span style=\"background-color: transparent; color: var(--blue-link);\">Тэргүүн байранд</span> “Өргөст хэмхэн баг” Г.Намжилмаа, Б.Баасансүрэн, Б.Чимэддулам,</p><p><span style=\"background-color: transparent; color: var(--blue-link);\">Дэд байранд</span> “Арвайхээр баг” М.Батцэцэг, Б.Оюумаа, Д.Нэргүй,</p><p><span style=\"background-color: transparent; color: var(--blue-link);\">Гутгаар байранд</span> тарагт сумын “Хос арвайн түрүү баг” Л.Чогдон, Д.Хэнмэдхэв, Г.Оюунгэрэл нар тус тус тодорлоо.</p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/tfe/1/16/1f44f.png\" alt=\"👏\" height=\"16\" width=\"16\">Тэмцээнийг хамтран зохион байгуулсан Өвөрхангай аймаг дахь Политехник коллежийн Хөдөө аж ахуйн баг, аймгийн Засаг даргын дэргэдэх Хүнс, хөдөө аж ахуйн газартаа талархал илэрхийлье.</p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/tfe/1/16/1f44f.png\" alt=\"👏\" height=\"16\" width=\"16\">Мөн шагналт байранд шалгарсан болон уралдаанд оролцсон нийт хүлэмжийн аж ахуй эрхлэгчдэдээ халуун баяр хүргэж, цаашдын ажил хөдөлмөрт нь өндрөөс өндөр амжилт хүсэн ерөөе. </p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t94/1/16/1f49a.png\" alt=\"💚\" height=\"16\" width=\"16\">Ургац арвин байг ээ.</p><p><a href=\"https://www.facebook.com/EcoSchoolMongolia?__cft__[0]=AZWpBX2wOSDssRDfMdXmfw_NOu-90-z4EZsTNAzlSfrh4RrDUhGvS-GcJcm8YJfD4yAK_m3tQTozZ_xCQzu0pGZg5YMhqVATfnJVsrkDHulgfA1ub5ZeU3crC8zzz96A0-hXeQINacTznkANrwNMaFP_BqjzeBbgV_uNFBj6cfaeXdnw_tB39dWBJR9VMfe5_ohZd3Z9YGkDdJgcGxgaAGpJ&amp;__tn__=-]K-R\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"background-color: transparent; color: var(--blue-link);\">Eco-Schools Mongolia</a></p>', 1, 1),
(54, 'ЧАНАРТАЙ БОЛОВСРОЛ-НЭЭЛТТЭЙ ТҮНШЛЭЛ VI', '20240527085439', '2024-05-23 00:00:00', '<p>“ЧАНАРТАЙ БОЛОВСРОЛ-НЭЭЛТТЭЙ ТҮНШЛЭЛ VI” зөвлөгөөн зохион байгуулагдав. </p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/te2/1/16/270d.png\" alt=\"✍️\" height=\"16\" width=\"16\">Өвөрхангай аймгийн Засаг даргын тамгын газар, Боловсрол, шинжлэх ухааны газар, Өвөрхангай аймаг дахь Политехник Коллеж хамтран зохион байгуулсан <span style=\"background-color: transparent; color: var(--blue-link);\">Чанартай Боловсрол Нээлттэй түншлэл VI</span>  зөвлөгөөнд Өвөрхангай аймгийн ЕБС-ийн захирлууд, 9-р анги удирдсан багш нарын төлөөлөл, Арвайхээр сумын багийн Засаг дарга нар, ажил олгогчдын төлөөлөл оролцож, олон талын оролцоонд суурилсан Мэргэжлийн болон Техникийн боловсролын тогтолцоог бий болгоход сургалтын байгууллагын сайн туршлагыг бүсчилсэн хөгжлийн бодлогын хүрээнд хөгжүүлэх, бүс орон нутгийн хэмжээнд хөдөлмөрийн зах зээлийн эрэлтэд нийцсэн мэргэжилтэй ажилтныг бэлтгэхэд анхаарах үнэ цэнийг өсгөх, төрийн байгууллагуудын хамтын ажиллагааг тасралтгүй бэхжүүлэх зорилго дор зөвлөлдлөө.</p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/te2/1/16/270d.png\" alt=\"✍️\" height=\"16\" width=\"16\">Зөвлөгөөнийг нээж Өвөрхангай аймгийн Засаг дарга И.Доржсүрэн мэргэжилтэй ажилтан бэлтгэх эх үйлсэд аймаг орон нутгийнхаа нэрийг гарган түүчээлж байгаа Политехник коллежийн хамт олонд болон зөвлөгөөнд оролцож байгаа нийт оролцогчдодоо талархал илэрхийлж, амжилт хүсэв.</p><p>Тус зөвлөгөөний үеэр:</p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/te2/1/16/270d.png\" alt=\"✍️\" height=\"16\" width=\"16\">Өвөрхангай аймаг дахь Политехник коллежийн захирал С.Санчир \"Өвөрхангай аймаг дахь Политехник коллежийн танилцуулга, хичээл сургалтын үйл ажиллагаа\"-ны талаар,</p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/te2/1/16/270d.png\" alt=\"✍️\" height=\"16\" width=\"16\">Нийгмийн бодлогын хэлтсийн дарга Б.Сайнжаргал \"Өвөрхангай аймгийн Засаг даргын 2020-2024 оны үйл ажиллагааны хөтөлбөрт техникийн боловсрол сургалтын талаарх бодлого, түүний хэрэгжилт, үр дүн\"-ийн талаар,</p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/te2/1/16/270d.png\" alt=\"✍️\" height=\"16\" width=\"16\">Хөдөлмөр халамж үйлчилгээний газрын Хөдөлмөр эрхлэлтийн асуудал хариуцсан мэргэжилтэн С.Даваасүрэн \"Өвөрхангай аймгийн хөдөлмөрийн зах зээлийн эрэлт, нийлүүлэлт чиг хандлага\"-ын талаар,</p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/te2/1/16/270d.png\" alt=\"✍️\" height=\"16\" width=\"16\">Өвөрхангай аймаг дахь Политехник коллежийн сургалтын менежер С.Уртнасан, Арга зүйч багш Б.Оюумаа, С.Отгонбаяр нар Өвөрхангай аймаг дахь Политехник коллежийн 2024-2025 оны хичээлийн жилийн үйл ажиллагааны чиглэл, тоон мэдээлэл, Мэргэжлийн болон Техникийн боловсрол сургалт онцлог\"-ийн талаар, </p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/te2/1/16/270d.png\" alt=\"✍️\" height=\"16\" width=\"16\">Өвөрхангай аймаг дахь Политехник коллежийн Нийгмийн түншлэл, үйлдвэрлэлийн дадлага хариуцсан арга зүйч Г.Жавзандорж \"Өвөрхангай аймаг дахь Политехник коллежийн нийгмийн түншлэл, төгсөгчдийн хөдөлмөр эрхлэлтийн байдал\"-ын талаар, </p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/te2/1/16/270d.png\" alt=\"✍️\" height=\"16\" width=\"16\">Ажил олгогчдын төлөөлөл Барилгачдын холбооны тэргүүн Д.Буянбаяр, Дөрвөн Эрдэнэ Хоёр Эс ХХК-ын менежер Ж.Оюунсүрэн, Дэлгэрэх Индустриал ХХК-ын захирал Г.Ганцэцэг, Өв-Ур ХХК-ын захирал Н.Ууганбаяр нар \"Ирээдүйд хөтлөх түншлэл\"-ийн талаар илтгэл тавьж, асуудал хэлэлцэж, санал солилцсон үр дүнтэй зөвлөгөөн болж өндөрлөлөө.</p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t64/1/16/1f91d.png\" alt=\"🤝\" height=\"16\" width=\"16\">Мөн тус зөвлөгөөний үеэр Мэдээллийн технологи, Оёмол бүтээгдэхүүний оёдолчин, Барилгын мэргэжлийн зөвлөлүүдтэй хамтын гэрээг үзэглэв.</p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t58/1/16/1f929.png\" alt=\"🤩\" height=\"16\" width=\"16\">Зөвлөгөөнийг хааж Өвөрхангай аймаг дахь Политехник коллежийн захирал С.Санчир зөвлөгөөнд оролцогчдодоо талархал илэрхийлж, цаашдын ажил хөдөлмөрт нь амжилт хүслээ.</p>', 1, 1),
(55, 'ГАДААД ХАРИЛЦААГАА ӨРГӨЖҮҮЛЭН, ХАМТРАН АЖИЛЛАХ ГЭРЭЭ БАЙГУУЛАВ', '20240603123644', '2024-05-27 00:00:00', '<p>🖋🇲🇳🇰🇷Өвөрхангай аймаг дахь Политехник коллежид Бүгд найрамдах Солонгос улсын Инчеон хотын Кён Ин эмэгтэйчүүдийн их сургуулийн олон улсын боловсролын төвийн дарга Жо Аэри, гадаад харилцааны ажилтан С.Саранчимэг нар ажиллалаа.</p><p><br></p><p>👨‍💼👩‍💼Уулзалтын үеэр хоёр сургууль хоорондын хамтын ажиллагааны гэрээг үзэглэв. Энэхүү гэрээний хүрээнд 1+1 хөтөлбөрийг хэрэгжүүлэн суралцагч солилцооны хөтөлбөрт хамрагдах боломжийг нээлээ.</p><p><br></p><p>Тухайлбал суралцагч 1 жил сургуульдаа сонгогдсон мэргэжлийн дагуу мэргэшүүлэх сургалтад хамрагдан хэлний мэдлэгээ дээшлүүлж, 2 дахь жилдээ Солонгос улсын коллежид суралцан мэргэжлийн дипломтой төгсөх, цаашлаад их сургуульд үргэлжлүүлэн суралцах боломжийг бүрдүүлж байгаа юм.</p><p><br></p><p>🤝🥰👏Хоёр сургуулийн хамтын ажиллагаа өргөжин батжих болтугай.</p>', 1, 1),
(56, 'ҮНДЭСНИЙ БИЧИГ ҮСГИЙН БАЯР АРГА ХЭМЖЭЭГ ТЭМДЭГЛЭН ӨНГӨРҮҮЛЭВ', '20240603123833', '2024-05-17 00:00:00', '<p><span style=\"color: rgb(102, 102, 102);\">Монгол улсын Ерөнхийлөгчийн 2023 оны 105 дугаар зарлигийг хэрэгжүүлэх, эх хэл, бичиг үсгээ эрхэмлэн дээдлэх, бичиг соёлын дурсгалаа сурталчлах, олон нийтэд таниулах, өвлүүлэх, хөгжүүлэх зорилгоор “Үндэсний бичиг үсгийн баяр” арга хэмжээг тус сургуулийн багш, суралцагчдын дунд зохион байгууллаа.</span></p><p><span style=\"color: rgb(102, 102, 102);\">📌Тус арга хэмжээний үеэр суралцагчдын дунд зохион байгуулсан:</span></p><p><span style=\"color: rgb(102, 102, 102);\">АХА төрөлд:</span></p><p>	<span style=\"color: rgb(102, 102, 102);\">Тэргүүн байранд Ө.Бүрэнцэцэг,</span></p><p>	<span style=\"color: rgb(102, 102, 102);\">Дэд байранд Б.Сугармаа,</span></p><p>	<span style=\"color: rgb(102, 102, 102);\">Гутгаар байранд Б.Дөлгөөн</span></p><p><span style=\"color: rgb(102, 102, 102);\">Хурдан уншлагын төрөлд:</span></p><p>	<span style=\"color: rgb(102, 102, 102);\">Тэргүүн байранд Б.Оюун-Эрдэнэ,</span></p><p>	<span style=\"color: rgb(102, 102, 102);\">Дэд байранд Г.Мөнхнаран,</span></p><p>	<span style=\"color: rgb(102, 102, 102);\">Гутгаар байранд Нямжаргал,</span></p><p><span style=\"color: rgb(102, 102, 102);\">Бүтээлийн төрөлд:</span></p><p>	<span style=\"color: rgb(102, 102, 102);\">Тэргүүн байранд Б.Хишигдулам,</span></p><p>	<span style=\"color: rgb(102, 102, 102);\">Дэд байранд И.Бямбадолгор,</span></p><p><span style=\"color: rgb(102, 102, 102);\">Хичээнгүй бичгийн төрөлд:</span></p><p>	<span style=\"color: rgb(102, 102, 102);\">Тэргүүн байранд Г.Нямжаргал,</span></p><p>	<span style=\"color: rgb(102, 102, 102);\">Дэд байранд Д.Оюунхорол,</span></p><p>	<span style=\"color: rgb(102, 102, 102);\">Гутгаар байранд Б.Олзгэрэл,</span></p><p><span style=\"color: rgb(102, 102, 102);\">Уран жиргээний төрөлд:</span></p><p>	<span style=\"color: rgb(102, 102, 102);\">Тэргүүн байранд Б.Оюун-Эрдэнэ,</span></p><p>	<span style=\"color: rgb(102, 102, 102);\">Дэд байранд Б.Пүрэвбат,</span></p><p><span style=\"color: rgb(102, 102, 102);\">Хүрэл тулгын төрөлд:</span></p><p>	<span style=\"color: rgb(102, 102, 102);\">Тэргүүн байранд Б.Оюун-Эрдэнэ,</span></p><p>	<span style=\"color: rgb(102, 102, 102);\">Дэд байранд Ш.Гантуяа нар тус тус тодорлоо.</span></p><p><span style=\"color: rgb(102, 102, 102);\">👏Шагналт байранд шалгарсан болон оролцсон суралцагчдадаа халуун баяр хүргэе.</span></p><p><span style=\"color: rgb(102, 102, 102);\">👏Мөн бидний үйл ажиллагааг дэмжин ажилласан Арьсаар гар урлалын зүйл урлаач мэргэжлийн багш Ц.Алтангэрэл багшдаа болон Улсын драмын театрын жүжигчин Г.Алтангэрэл, Г.Намуун нартаа талархал илэрхийлье.</span></p>', 1, 1),
(57, 'Багш ажилтнууд маань хөдөлмөр бүтээлээ үнэлүүлж, шагналын хур буулаа', '20240613091115', '2024-06-10 00:00:00', '<p>Өвөрхангай аймаг дахь Политехник коллежийн түүхт 50 жилийн ойн баярын босгон дээр багш ажилтнууд маань хөдөлмөр бүтээлээ үнэлүүлж, шагналын хур буулаа. </p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/tac/1/16/1f4cc.png\" alt=\"📌\" height=\"16\" width=\"16\">Монгол Улсын Засгийн газрын шагнал “БОЛОВСРОЛЫН ТЭРГҮҮНИЙ АЖИЛТАН” хүндэт тэмдгээр:</p><p>- Математикийн багш Тогоочийн Чимэддолгор</p><p>- Эдийн засаг, бизнесийн ухааны багш Сүхэнхүүгийн Дуламсүрэн</p><p>- Уул уурхайн машин, тоног төхөөрөмжийн механикийн багш Ядамсүрэнгийн Даваадаш</p><p>- Амьдрах ухааны багш Түмэн-Өлзийгийн Чулуунцэцэг</p><p>- Монгол хэл, уран зохиолын багш Батчулууны Эрдэнэцэцэг</p><p>- Автомеханикийн багш Цэрмаагийн Амарбаяр</p><p>- Нийгмийн ажилтан Жамъянсүрэнгийн Мягмаржав</p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/tac/1/16/1f4cc.png\" alt=\"📌\" height=\"16\" width=\"16\">Монгол Улсын Засгийн газрын шагнал “ХӨДӨЛМӨРИЙН ТЭРГҮҮНИЙ АЖИЛТАН” хүндэт тэмдгээр:</p><p>- Уул уурхайн машин, тоног төхөөрөмжийн механикийн багш Отгонжаргалын Цогтсайхан</p><p>- Биеийн тамирын багш Алтангэрэлийн Нармандах</p><p>- Хөдөлмөрийн аюулгүй байдал, эрүүл ахуй хариуцсан ахлах ажилтан Цэнд-Аюушийн Батжаргал</p><p>- Нягтлан бодогч Мягмарсүрэнгийн Иш</p><p>- Жижүүр Бямбасүрэнгийн Цэерэгзэн</p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/tac/1/16/1f4cc.png\" alt=\"📌\" height=\"16\" width=\"16\">Монгол Улсын Засгийн газрын шагнал “СОЁЛЫН ТЭРГҮҮНИЙ АЖИЛТАН” хүндэт тэмдгээр:</p><p>- Химийн багш Нэргүйн Ууганбаатар</p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/tac/1/16/1f4cc.png\" alt=\"📌\" height=\"16\" width=\"16\">Боловсрол, шинжлэх ухааны яамны “Жуух бичиг”-ээр:</p><p>- Англи хэлний багш Батбаярын Оюун</p><p>- Эрүүл мэндийн багш Отгонцэндийн Бунд</p><p>- Нийгмийн түншлэл, үйлдвэрлэлийн сургалт хариуцсан арга зүйч Гантулгын Жавзандорж</p><p>- Нийгмийн ажилтан Лувсанцэрэнгийн Лхагвадолгор</p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/tac/1/16/1f4cc.png\" alt=\"📌\" height=\"16\" width=\"16\">Хөдөлмөр, нийгмийн хамгааллын яамны “Жуух бичиг”-ээр:</p><p>- Биеийн тамирын багш Пүрэвбаатарын Содномцоо</p><p>- Жижүүр Жанцангийн Амарсайхан</p><p>- Жижүүр Цэрэнпунцагийн Тунирмаа нар тус тус шагнууллаа.</p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/tfe/1/16/1f44f.png\" alt=\"👏\" height=\"16\" width=\"16\">Түмэн олон шавь нарынхаа хайр талархалд хөглөгдөн, төрдөө үнэлэгдсэн эрхэм хүндэт багш нартаа нийт Өвөрхангай аймаг дахь Политехник Коллежийн хамт олноос нь халуун баяр хүргэе.</p>', 1, 1),
(58, 'ЭРДМИЙН БАЯР-2024', '20240613091308', '2024-06-07 00:00:00', '<p>Өвөрхангай аймаг дахь Политехник коллежийн \"Эрдмийн баяр\", диплом гардуулах үйл ажиллагаа зохион байгуулагдлаа.</p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/tac/1/16/1f4cc.png\" alt=\"📌\" height=\"16\" width=\"16\">Тус сургуулийн 2023-2024 оны хичээлийн жилийн хаврын төгсөлтөөр мэргэжлийн боловсрол сургалтын ангийг мэргэжлийн боловсрол сургалтын 1 жилтэй ангийг 259 суралцагч, Техникийн боловсрол олгох сургалтын 1,5 жилтэй ангийг 61 суралцагч тус тус амжилттай суралцан, диплом болон мэргэжлийн үнэмлэхээ гардан авлаа.</p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/tfe/1/16/1f44f.png\" alt=\"👏\" height=\"16\" width=\"16\">Сургуульдаа амжилттай суралцаад, төгсөж байгаа суралцагчиддаа цаашдынх нь ажил амьдралд нь өндрөөс өндөр амжилт хүсэн ерөөе.</p>', 1, 1);
